(1, 'In theo yêu cầu', 'in-theo-yeu-cau', '', 'Admin', '&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt;Trải nghiệm dịch vụ độc đáo chỉ có tại KIMTASHOP , hãy thoả sức sáng tạo để tạo ra những tác phẩm chỉ dành cho riêng bạn . &lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; -----------&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; - Sử dụng công nghệ in ấn 3D đến từ Nhật Bản&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; - Mực in có độ bền màu cực cao trên 3 năm&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; - Đảm bảo không bong tróc không ố vàng trong suốt thời gian sử dụng .&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; - Tư vấn thiết kế miễn phí&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; - Giao hàng thu tiền tận nhà , hoàn tiền nếu không hài lòng với sản phẩm dịch vụ .&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; -----------&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; CLICK VÀO LINK : &amp;nbsp;http://fb.com/messages/kimtashop&amp;nbsp;để được tư vấn miễn phí .&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; -----------&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt; - Chia sẻ quan điểm kinh doanh : &lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt;Với KIMTASHOP sự thoả mãn về trải nghiệm và hài lòng của các bạn là mục tiêu mà toàn thể team luôn phấn đấu từng ngày để cải thiện và nâng cao chất lượng sản phẩm dịch vụ . Trong quá trình giao tiếp , tương tác , phục vụ vận chưa tránh được sai sót nên mong các bạn chủ động inbox fanpage hoặc gọi số 0914081881 để xử lý kịp thời tránh mang lại cho các bạn cảm xúc đáng tiếc .&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt;- Với KIMTA SHOP mua hàng là phải vui nhé các bạn ! Cảm xúc và trải nghiệm độc đáo là điều KIMTA mong muốn các bạn nhận được khi mua sắm tại shop !&lt;/span&gt;&lt;br style="color: #141823; font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.3199996948242px;" data-mce-style="color: #141823; font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.3199996948242px;"&gt;&lt;br&gt;&lt;span style="font-size: 12pt;" data-mce-style="font-size: 12pt;"&gt;&lt;img src="//hstatic.net/880/1000003880/10/2015/7-1/banner_custom.jpg" data-mce-src="//hstatic.net/880/1000003880/10/2015/7-1/banner_custom.jpg"&gt;&lt;/span&gt;\r\n', 0, '2015-07-30 16:27:25', 1, '2015-08-18 23:47:07', 101, 255, 1, '', '', '', '', 'vi', '/phoneshop/public/files/editor-upload/images/san-pham-1.jpg', '/phoneshop/public/files/editor-upload/_thumbs/images/san-pham-1.jpg', '', '', '', '', ''),
