INSERT INTO `phppos_quotes_contract` (`id_quotes_contract`, `title_quotes_contract`, `content_quotes_contract`, `cat_quotes_contract`) VALUES
(1, 'Hợp đồng kinh tế', '<p><strong>CỘNG HOÀ XÃ HỘI CHỦ NGHĨA VIỆT NAM</strong></p>\n\n<p>Độc lập - Tự do - Hạnh phúc</p>\n\n<p>-------------oOo-----------</p>\n\n<p> </p>\n\n<p><strong>HỢP ĐỒNG KINH TẾ</strong></p>\n\n<p><em>Số: ........../ 20…/ HĐKT</em></p>\n\n<p> </p>\n\n<p>   - Căn cứ Bộ luật Dân sự số 33/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào Luật Thương Mại số 36/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào nhu cầu, khả năng của hai bên.</p>\n\n<p>Hôm nay, ngày …..  tháng ….năm 2015  Chúng tôi gồm:</p>\n\n<p><strong>Bên A:   </strong>{TEN_NCC}</p>\n\n<ul>\n <li>Địa chỉ                    :     {DIA_CHI_NCC}</li>\n <li>Điện thoại               :     {SDT_NCC}</li>\n <li>Fax                           :     …………………………………………………………………</li>\n <li>CMTND                  :   …………CA Thành phố ………….… cấp ngày…………..…..</li>\n</ul>\n\n<p><strong>Bên B:   Công ty TNHH Công Nghệ Tự Động Hóa Minh Anh.</strong></p>\n\n<ul>\n <li>Địa chỉ                    :    Số 23 ngõ 389/4 Hoàng Quốc Việt – Quận Cầu Giấy -  Hà Nội.</li>\n <li>Điện thoại               :     +84 4–378 5885.</li>\n <li>Fax                           :     +84 4–378 5885.</li>\n <li>Mã số thuế                 :     0101130774.</li>\n <li>Đại diện bởi           :     Ông  <strong>Nguyễn Xuân Giang</strong></li>\n <li>Chức vụ                  :     Phó Giám đốc</li>\n <li>Tài khoản số          :     10820962715015</li>\n <li>Tại Ngân hàng        :     Ngân hàng TMCP Kỹ Thương – CN Hoàn Kiếm – Hà Nội</li>\n</ul>\n\n<p> </p>\n\n<p>Tại Trụ sở bên A, hai bên thỏa thuận ký kết hợp đồng kinh tế này với các điều khoản sau:</p>\n\n<p><strong><em>Điều 1:</em></strong><strong><em> Nội dung công việc</em></strong></p>\n\n<p>1.1. Bên B nhận cung cấp bằng nhập khẩu cho bên A  …… ( ….. ) thang máy tải khách (mã hiệu ………..), tải trọng …..kg (….. người ), tốc độ …… m/phút, ….. điểm dừng , xuất xứ ………, mới 100%, sản xuất năm ……. trở về sau.</p>\n\n<p><em>(Theo Bản Phụ lục Hợp đồng 1)</em></p>\n\n<p>1.2. Cung cấp vật tư lắp đặt và lắp đặt hoàn chỉnh thang máy trên tại công trình :</p>\n\n<p>“……………………………………………………………………………………………………………………………………………..……………”</p>\n\n<p><strong><em>Điều 2:</em></strong><strong><em> Trách nhiệm của bên A</em></strong></p>\n\n<ul>\n <li>Xây dựng, hiệu chỉnh hố thang đảm bảo các thông số kỹ thuật cho việc lắp đặt thang máy theo bản vẽ kỹ thuật hố thang do bên B cung cấp.</li>\n <li>Chậm nhất là trong vòng 5 ngày kể từ ngày bên B chuyển bản vẽ kỹ thuật, bên A phải ký xác nhận vào bản vẽ kỹ thuật sau khi đã thống nhất để Bên B đặt hàng với Hãng sản xuất. Quá thời hạn trên coi như bên A đã đồng ý với bản vẽ kỹ thuật mà bên B đã chuyển để hai bên thực hiện công việc.</li>\n <li>Bên A giao đầy đủ hồ sơ thiết kế liên quan đến hố thang máy cho Bên B.</li>\n <li>Cử cán bộ có trách nhiệm phối hợp cùng bên B tham gia kiểm tra và ký xác nhận thiết bị thang máy khi lô thiết bị được chuyển về chân công trình. Nếu tại thời điểm hàng về chân công trình, bên A không bố trí được người kiểm tra, bên B vẫn vận chuyển lô thiết bị trên vào kho và lô thiết bị trên coi như đã được kiểm tra đầy đủ, đúng theo danh mục hồ sơ thang máy kèm theo.</li>\n <li>Bố trí kho chứa thiết bị an toàn tại tầng một khi bên B vận chuyển thiết bị đến công trình và đảm bảo an ninh cho kho chứa thiết bị thang máy tại công trình.</li>\n <li>Bàn giao mặt bằng đủ điều kiện để thi công lắp đặt cho bên B đúng tiến độ.</li>\n <li>Cung cấp điểm đấu nối nguồn điện để thi công, lắp đặt thang máy trong khu vực thi công.</li>\n <li>Cung cấp nguồn điện 3 phase 380V/220V và 01 Aptomat 3 phase /1 thang và điểm đấu nối dây tiếp địa tại phòng đặt máy để bên B hiệu chỉnh thang máy .</li>\n <li>Bên A cử cán bộ kỹ thuật thường xuyên phối hợp cùng bên B trong suốt quá trình thi công lắp đặt để giải quyết kịp thời các công việc trong quá trình thực hiện hợp đồng.</li>\n <li> Tổ chức nghiệm thu, ký biên bản nghiệm thu giai đoạn (nếu có) và nghiệm thu bàn giao kịp thời khi bên B hoàn tất công việc.</li>\n <li>Thực hiện phần việc xây dựng hoàn thiện sau khi bên B hoàn tất lắp đặt thiết bị thang máy.</li>\n <li>Tạm ứng và thanh toán kịp thời cho Bên B theo điều 6 của Hợp đồng.</li>\n</ul>\n\n<p><strong><em>Điều 3:</em></strong><strong><em> Trách nhiệm của bên B</em></strong></p>\n\n<ul>\n <li>Khảo sát và thiết kế bản vẽ hố thang theo tiêu chuẩn và chuyển cho bên A ký xác nhận làm cơ sở đặt hàng với Hãng sản xuất và thực hiện các công việc liên quan.</li>\n <li>Nhập khẩu thiết bị thang máy theo các thông số kỹ thuật của Phụ lục số 01 về đặc tính kỹ thuật thang máy.</li>\n <li>Trước khi vận chuyển thiết bị về công trình, bên B có trách nhiệm thông báo cho bên A ngày thiết bị về đến công trình để bên A bố trí kho chứa thiết bị tại công trình.</li>\n <li>Vận chuyển thiết bị đến công trình,  phối hợp cùng với đại diện của bên A kiểm tra và ký xác nhận vào các biên bản.</li>\n <li>Cung cấp vật tư  lắp đặt và lắp đặt, hiệu chỉnh, đưa thang máy vào sử dụng.</li>\n <li>Có trách nhiệm mời cơ quan có chức năng, tổ chức kiểm định - cung cấp Biên bản kiểm định kỹ thuật an toàn thang máy của cơ quan Nhà nước có thẩm quyền đủ điều kiện an toàn sử dụng bàn giao cho bên A.</li>\n <li>Có trách nhiệm quản lý, đảm bảo an ninh, an toàn trong quá trình thi công trên công trình và giữ gìn vệ sinh môi trường trong suốt thời gian thi công.</li>\n <li>Đảm bảo và chịu trách nhiệm về các điều kiện an toàn cho con người, an ninh trong khu vực thi công theo quy định chung.</li>\n <li>Hướng dẫn cách sử dụng vận hành thang máy cho bên A.</li>\n <li>Bên B có trách nhiệm bảo hành công trình theo quy định tại điều 7 của Hợp đồng kinh tế.</li>\n</ul>\n\n<p><strong><em>Điều 4:</em></strong><strong><em> Tiến độ thực hiện được bên B thực hiện như sau:  </em></strong></p>\n\n<table border="0" cellpadding="0" cellspacing="0">\n <tbody>\n  <tr>\n   <td>\n   <p>4.1 Thời gian thiết bị thang máy đ­ược nhập khẩu và vận chuyển đến công trình kể từ ngày bên B nhận được kinh phí tạm ứng kỳ 1 và bên A xác nhận vào bản vẽ kỹ thuật hố thang là: …. tháng</p>\n   </td>\n  </tr>\n  <tr>\n   <td>\n   <p>4.2 Thời gian lắp đặt, hiệu chỉnh được thực hiện khi bên B nhận được kinh phí thanh toán kỳ 2, bên A bàn giao mặt bằng đầy đủ điều kiện thi công và ký biên bản nghiệm thu thiết bị trước khi lắp đặt là: ….. ngày</p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p>-   Tiến độ trên chỉ được thực hiện với các điều kiện sau:</p>\n\n<ul>\n <li>Bên A thanh toán đúng thời hạn và giá trị đã ghi ở điều 5 và điều 6 hợp đồng này.</li>\n <li>Các chi tiết kỹ thuật của thang máy phải được bên A thống nhất trước khi ký kết hợp đồng kinh tế. Trong trường hợp có những thay đổi về chi tiết kỹ thuật của thang máy từ phía bên A như bổ sung, bỏ bớt hoặc điều chỉnh thì hai bên thống thất bằng một văn bản hoặc phụ lục hợp đồng bổ sung để hiệu chỉnh giá trị hợp đồng và tiến độ thực hiện nhưng thời gian cho việc thay đổi trong vòng 30 ngày kể từ ngày hợp đồng có hiệu lực.</li>\n <li>Việc lắp đặt thang máy chỉ được tiến hành sau khi điều 4.2 đã được thực hiện .</li>\n</ul>\n\n<p><strong><em>Điều 5:</em></strong><strong><em>  Giá trị của hợp đồng kinh tế </em></strong></p>\n\n<ul>\n <li>Giá trị hợp đồng kinh tế cung cấp lắp đặt thang máy là: khoản tiền VNĐ có giá trị bảo đảm tương đương: <strong>………….. VND <em>(…………………….. VND</em></strong>) <strong>.</strong>             </li>\n</ul>\n\n<p><strong><em>               ( Bằng chữ: …………………………………………………………………. )</em></strong></p>\n\n<ul>\n <li><em>Giá trị hợp đồng trên đã bao gồm: giá thiết bị thang máy nhập khẩu về tới chân công trình, vật tư lắp đặt, chi phí lắp đặt, hiệu chỉnh, tổ chức kiểm định thang máy cấp giấy chứng nhận thang máy đủ điểu kiện an toàn sử dụng, chi phí bảo hành  và thuế GTGT.</em></li>\n</ul>\n\n<p><strong><em>Điều 6:</em></strong><strong><em> Ph­ương thức thanh toán </em></strong></p>\n\n<ul>\n <li>Bên A tạm ứng, thanh toán cho bên B theo các kỳ nh­ư sau:</li>\n</ul>\n\n<ul>\n <li>Kỳ 1: Tạm ứng <strong>40</strong>% tổng giá trị hợp đồng kinh tế ngay sau khi Hợp đồng kinh tế được ký kết.</li>\n</ul>\n\n<ul>\n <li>Kỳ 2: Thanh toán 5<strong>0%</strong> tổng giá trị hợp đồng kinh tế - không bao gồm giá trị đã tạm ứng kỳ 1 - trong vòng 7 ngày sau khi thiết bị thang máy đ­ược chuyển đến chân công trình.</li>\n <li>Kỳ 3: Thanh toán phần còn lại của tổng giá trị hợp đồng trong vòng 10 ngày kể từ ngày bên B hoàn tất việc lắp đặt và thang máy được kiểm định an toàn.</li>\n</ul>\n\n<ul>\n <li>Tr­ường hợp bên A không thực hiện đầy đủ nghĩa vụ thanh toán như­ đã thống nhất ở trên, bên B có quyền ngừng thực hiện các công việc liên quan đến thang máy cho đến khi bên A hoàn thành nghĩa vụ thanh toán của mình và đền bù những thiệt hại cho bên B theo lãi suất quá hạn cho vay của Ngân hàng bên B mở tài khoản.</li>\n <li>Trong trường hợp bên B đã hoàn thành toàn bộ công việc theo như hợp đồng kinh tế đã ký kết mà bên A chưa có nguồn điện chính thức để sử dụng thang máy, hoặc chưa có nhu cầu sử dụng thì trách nhiệm của bên A là phải hoàn thành nghĩa vụ thanh toán toàn bộ giá trị hợp đồng cho bên B để bên B quyết toán hợp đồng và thực hiện nghĩa vụ nộp thuế theo quy định của Nhà nước.</li>\n</ul>\n\n<p><strong><em>Điều 7 :</em></strong><strong><em> Bảo hành và Bảo trì</em></strong></p>\n\n<ul>\n <li>Bên B có trách nhiệm bảo hành thiết bị trong thời hạn 12 tháng kể từ ngày thang máy được kiểm định an toàn. Nếu trong thời gian bảo hành mà thang máy bị hư hỏng, nhận được thông báo của bên A trong thời gian sớm nhất bên B phải cử người đến xử lý và chịu mọi phí tổn sửa chữa nếu xảy ra sự cố kỹ thuật do lỗi của nhà sản xuất hoặc do lỗi khác của bên B.</li>\n <li>Bên B có trách nhiệm lập quy trình bảo trì cho công trình khi hết thời hạn bảo hành và hai bên sẽ thương thảo, ký kết hợp đồng bảo trì cho công trình.</li>\n</ul>\n\n<p><strong><em>Điều 8:</em></strong><strong><em>  Hiệu lực hợp đồng </em></strong></p>\n\n<ul>\n <li>Hợp đồng kinh tế này có hiệu lực kể từ ngày ký và không đư­ợc hủy ngang, nếu bên nào vi phạm thì sẽ đền bù cho bên còn lại 20% giá trị Hợp đồng kinh tế.</li>\n <li>Hai bên cam kết thực hiện đúng các điều khoản ghi trong hợp đồng kinh tế. Khi có  vướng mắc hai bên cùng trao đổi để khắc phục. Nếu không giải quyết được bằng thương lượng thì một trong hai bên sẽ đưa ra Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội để giải quyết. Phán quyết của Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội là phán quyết cuối cùng để hai bên thực hiện, mọi chi phí phát sinh và án phí do bên có lỗi chịu trách nhiệm thanh toán.</li>\n <li>Hợp đồng này đ­ược lập thành ….. bản, mỗi bên giữ …. bản và có giá trị pháp lý nh­ư nhau.</li>\n</ul>\n\n<p><strong>                  ĐẠI DIỆN BÊN A                                              ĐẠI DIỆN BÊN B</strong></p>\n', 1),
(2, 'Hợp đồng kinh tế', '<p><strong>CỘNG HOÀ XÃ HỘI CHỦ NGHĨA VIỆT NAM</strong></p>\n\n<p>Độc lập - Tự do - Hạnh phúc</p>\n\n<p>-------------oOo-----------</p>\n\n<p> </p>\n\n<p><strong>HỢP ĐỒNG KINH TẾ</strong></p>\n\n<p><em>Số: ........../ 20…/ HĐKT</em></p>\n\n<p> </p>\n\n<p>   - Căn cứ Bộ luật Dân sự số 33/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào Luật Thương Mại số 36/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào nhu cầu, khả năng của hai bên.</p>\n\n<p>Hôm nay, ngày …..  tháng ….năm 2015  Chúng tôi gồm:</p>\n\n<p><strong>Bên A:   </strong>{TEN_NCC}</p>\n\n<ul>\n <li>Địa chỉ                    :     {DIA_CHI_NCC}</li>\n <li>Điện thoại               :     {SDT_NCC}</li>\n <li>Fax                           :     …………………………………………………………………</li>\n <li>CMTND                  :   …………CA Thành phố ………….… cấp ngày…………..…..</li>\n</ul>\n\n<p><strong>Bên B:   Công ty TNHH Công Nghệ Tự Động Hóa Minh Anh.</strong></p>\n\n<ul>\n <li>Địa chỉ                    :    Số 23 ngõ 389/4 Hoàng Quốc Việt – Quận Cầu Giấy -  Hà Nội.</li>\n <li>Điện thoại               :     +84 4–378 5885.</li>\n <li>Fax                           :     +84 4–378 5885.</li>\n <li>Mã số thuế                 :     0101130774.</li>\n <li>Đại diện bởi           :     Ông  <strong>Nguyễn Xuân Giang</strong></li>\n <li>Chức vụ                  :     Phó Giám đốc</li>\n <li>Tài khoản số          :     10820962715015</li>\n <li>Tại Ngân hàng        :     Ngân hàng TMCP Kỹ Thương – CN Hoàn Kiếm – Hà Nội</li>\n</ul>\n\n<p> </p>\n\n<p>Tại Trụ sở bên A, hai bên thỏa thuận ký kết hợp đồng kinh tế này với các điều khoản sau:</p>\n\n<p><strong><em>Điều 1:</em></strong><strong><em> Nội dung công việc</em></strong></p>\n\n<p>1.1. Bên B nhận cung cấp bằng nhập khẩu cho bên A  …… ( ….. ) thang máy tải khách (mã hiệu ………..), tải trọng …..kg (….. người ), tốc độ …… m/phút, ….. điểm dừng , xuất xứ ………, mới 100%, sản xuất năm ……. trở về sau.</p>\n\n<p><em>(Theo Bản Phụ lục Hợp đồng 1)</em></p>\n\n<p>1.2. Cung cấp vật tư lắp đặt và lắp đặt hoàn chỉnh thang máy trên tại công trình :</p>\n\n<p>“……………………………………………………………………………………………………………………………………………..……………”</p>\n\n<p><strong><em>Điều 2:</em></strong><strong><em> Trách nhiệm của bên A</em></strong></p>\n\n<ul>\n <li>Xây dựng, hiệu chỉnh hố thang đảm bảo các thông số kỹ thuật cho việc lắp đặt thang máy theo bản vẽ kỹ thuật hố thang do bên B cung cấp.</li>\n <li>Chậm nhất là trong vòng 5 ngày kể từ ngày bên B chuyển bản vẽ kỹ thuật, bên A phải ký xác nhận vào bản vẽ kỹ thuật sau khi đã thống nhất để Bên B đặt hàng với Hãng sản xuất. Quá thời hạn trên coi như bên A đã đồng ý với bản vẽ kỹ thuật mà bên B đã chuyển để hai bên thực hiện công việc.</li>\n <li>Bên A giao đầy đủ hồ sơ thiết kế liên quan đến hố thang máy cho Bên B.</li>\n <li>Cử cán bộ có trách nhiệm phối hợp cùng bên B tham gia kiểm tra và ký xác nhận thiết bị thang máy khi lô thiết bị được chuyển về chân công trình. Nếu tại thời điểm hàng về chân công trình, bên A không bố trí được người kiểm tra, bên B vẫn vận chuyển lô thiết bị trên vào kho và lô thiết bị trên coi như đã được kiểm tra đầy đủ, đúng theo danh mục hồ sơ thang máy kèm theo.</li>\n <li>Bố trí kho chứa thiết bị an toàn tại tầng một khi bên B vận chuyển thiết bị đến công trình và đảm bảo an ninh cho kho chứa thiết bị thang máy tại công trình.</li>\n <li>Bàn giao mặt bằng đủ điều kiện để thi công lắp đặt cho bên B đúng tiến độ.</li>\n <li>Cung cấp điểm đấu nối nguồn điện để thi công, lắp đặt thang máy trong khu vực thi công.</li>\n <li>Cung cấp nguồn điện 3 phase 380V/220V và 01 Aptomat 3 phase /1 thang và điểm đấu nối dây tiếp địa tại phòng đặt máy để bên B hiệu chỉnh thang máy .</li>\n <li>Bên A cử cán bộ kỹ thuật thường xuyên phối hợp cùng bên B trong suốt quá trình thi công lắp đặt để giải quyết kịp thời các công việc trong quá trình thực hiện hợp đồng.</li>\n <li> Tổ chức nghiệm thu, ký biên bản nghiệm thu giai đoạn (nếu có) và nghiệm thu bàn giao kịp thời khi bên B hoàn tất công việc.</li>\n <li>Thực hiện phần việc xây dựng hoàn thiện sau khi bên B hoàn tất lắp đặt thiết bị thang máy.</li>\n <li>Tạm ứng và thanh toán kịp thời cho Bên B theo điều 6 của Hợp đồng.</li>\n</ul>\n\n<p><strong><em>Điều 3:</em></strong><strong><em> Trách nhiệm của bên B</em></strong></p>\n\n<ul>\n <li>Khảo sát và thiết kế bản vẽ hố thang theo tiêu chuẩn và chuyển cho bên A ký xác nhận làm cơ sở đặt hàng với Hãng sản xuất và thực hiện các công việc liên quan.</li>\n <li>Nhập khẩu thiết bị thang máy theo các thông số kỹ thuật của Phụ lục số 01 về đặc tính kỹ thuật thang máy.</li>\n <li>Trước khi vận chuyển thiết bị về công trình, bên B có trách nhiệm thông báo cho bên A ngày thiết bị về đến công trình để bên A bố trí kho chứa thiết bị tại công trình.</li>\n <li>Vận chuyển thiết bị đến công trình,  phối hợp cùng với đại diện của bên A kiểm tra và ký xác nhận vào các biên bản.</li>\n <li>Cung cấp vật tư  lắp đặt và lắp đặt, hiệu chỉnh, đưa thang máy vào sử dụng.</li>\n <li>Có trách nhiệm mời cơ quan có chức năng, tổ chức kiểm định - cung cấp Biên bản kiểm định kỹ thuật an toàn thang máy của cơ quan Nhà nước có thẩm quyền đủ điều kiện an toàn sử dụng bàn giao cho bên A.</li>\n <li>Có trách nhiệm quản lý, đảm bảo an ninh, an toàn trong quá trình thi công trên công trình và giữ gìn vệ sinh môi trường trong suốt thời gian thi công.</li>\n <li>Đảm bảo và chịu trách nhiệm về các điều kiện an toàn cho con người, an ninh trong khu vực thi công theo quy định chung.</li>\n <li>Hướng dẫn cách sử dụng vận hành thang máy cho bên A.</li>\n <li>Bên B có trách nhiệm bảo hành công trình theo quy định tại điều 7 của Hợp đồng kinh tế.</li>\n</ul>\n\n<p><strong><em>Điều 4:</em></strong><strong><em> Tiến độ thực hiện được bên B thực hiện như sau:  </em></strong></p>\n\n<table border="0" cellpadding="0" cellspacing="0">\n <tbody>\n  <tr>\n   <td>\n   <p>4.1 Thời gian thiết bị thang máy đ­ược nhập khẩu và vận chuyển đến công trình kể từ ngày bên B nhận được kinh phí tạm ứng kỳ 1 và bên A xác nhận vào bản vẽ kỹ thuật hố thang là: …. tháng</p>\n   </td>\n  </tr>\n  <tr>\n   <td>\n   <p>4.2 Thời gian lắp đặt, hiệu chỉnh được thực hiện khi bên B nhận được kinh phí thanh toán kỳ 2, bên A bàn giao mặt bằng đầy đủ điều kiện thi công và ký biên bản nghiệm thu thiết bị trước khi lắp đặt là: ….. ngày</p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p>-   Tiến độ trên chỉ được thực hiện với các điều kiện sau:</p>\n\n<ul>\n <li>Bên A thanh toán đúng thời hạn và giá trị đã ghi ở điều 5 và điều 6 hợp đồng này.</li>\n <li>Các chi tiết kỹ thuật của thang máy phải được bên A thống nhất trước khi ký kết hợp đồng kinh tế. Trong trường hợp có những thay đổi về chi tiết kỹ thuật của thang máy từ phía bên A như bổ sung, bỏ bớt hoặc điều chỉnh thì hai bên thống thất bằng một văn bản hoặc phụ lục hợp đồng bổ sung để hiệu chỉnh giá trị hợp đồng và tiến độ thực hiện nhưng thời gian cho việc thay đổi trong vòng 30 ngày kể từ ngày hợp đồng có hiệu lực.</li>\n <li>Việc lắp đặt thang máy chỉ được tiến hành sau khi điều 4.2 đã được thực hiện .</li>\n</ul>\n\n<p><strong><em>Điều 5:</em></strong><strong><em>  Giá trị của hợp đồng kinh tế </em></strong></p>\n\n<ul>\n <li>Giá trị hợp đồng kinh tế cung cấp lắp đặt thang máy là: khoản tiền VNĐ có giá trị bảo đảm tương đương: <strong>………….. VND <em>(…………………….. VND</em></strong>) <strong>.</strong>             </li>\n</ul>\n\n<p><strong><em>               ( Bằng chữ: …………………………………………………………………. )</em></strong></p>\n\n<ul>\n <li><em>Giá trị hợp đồng trên đã bao gồm: giá thiết bị thang máy nhập khẩu về tới chân công trình, vật tư lắp đặt, chi phí lắp đặt, hiệu chỉnh, tổ chức kiểm định thang máy cấp giấy chứng nhận thang máy đủ điểu kiện an toàn sử dụng, chi phí bảo hành  và thuế GTGT.</em></li>\n</ul>\n\n<p><strong><em>Điều 6:</em></strong><strong><em> Ph­ương thức thanh toán </em></strong></p>\n\n<ul>\n <li>Bên A tạm ứng, thanh toán cho bên B theo các kỳ nh­ư sau:</li>\n</ul>\n\n<ul>\n <li>Kỳ 1: Tạm ứng <strong>40</strong>% tổng giá trị hợp đồng kinh tế ngay sau khi Hợp đồng kinh tế được ký kết.</li>\n</ul>\n\n<ul>\n <li>Kỳ 2: Thanh toán 5<strong>0%</strong> tổng giá trị hợp đồng kinh tế - không bao gồm giá trị đã tạm ứng kỳ 1 - trong vòng 7 ngày sau khi thiết bị thang máy đ­ược chuyển đến chân công trình.</li>\n <li>Kỳ 3: Thanh toán phần còn lại của tổng giá trị hợp đồng trong vòng 10 ngày kể từ ngày bên B hoàn tất việc lắp đặt và thang máy được kiểm định an toàn.</li>\n</ul>\n\n<ul>\n <li>Tr­ường hợp bên A không thực hiện đầy đủ nghĩa vụ thanh toán như­ đã thống nhất ở trên, bên B có quyền ngừng thực hiện các công việc liên quan đến thang máy cho đến khi bên A hoàn thành nghĩa vụ thanh toán của mình và đền bù những thiệt hại cho bên B theo lãi suất quá hạn cho vay của Ngân hàng bên B mở tài khoản.</li>\n <li>Trong trường hợp bên B đã hoàn thành toàn bộ công việc theo như hợp đồng kinh tế đã ký kết mà bên A chưa có nguồn điện chính thức để sử dụng thang máy, hoặc chưa có nhu cầu sử dụng thì trách nhiệm của bên A là phải hoàn thành nghĩa vụ thanh toán toàn bộ giá trị hợp đồng cho bên B để bên B quyết toán hợp đồng và thực hiện nghĩa vụ nộp thuế theo quy định của Nhà nước.</li>\n</ul>\n\n<p><strong><em>Điều 7 :</em></strong><strong><em> Bảo hành và Bảo trì</em></strong></p>\n\n<ul>\n <li>Bên B có trách nhiệm bảo hành thiết bị trong thời hạn 12 tháng kể từ ngày thang máy được kiểm định an toàn. Nếu trong thời gian bảo hành mà thang máy bị hư hỏng, nhận được thông báo của bên A trong thời gian sớm nhất bên B phải cử người đến xử lý và chịu mọi phí tổn sửa chữa nếu xảy ra sự cố kỹ thuật do lỗi của nhà sản xuất hoặc do lỗi khác của bên B.</li>\n <li>Bên B có trách nhiệm lập quy trình bảo trì cho công trình khi hết thời hạn bảo hành và hai bên sẽ thương thảo, ký kết hợp đồng bảo trì cho công trình.</li>\n</ul>\n\n<p><strong><em>Điều 8:</em></strong><strong><em>  Hiệu lực hợp đồng </em></strong></p>\n\n<ul>\n <li>Hợp đồng kinh tế này có hiệu lực kể từ ngày ký và không đư­ợc hủy ngang, nếu bên nào vi phạm thì sẽ đền bù cho bên còn lại 20% giá trị Hợp đồng kinh tế.</li>\n <li>Hai bên cam kết thực hiện đúng các điều khoản ghi trong hợp đồng kinh tế. Khi có  vướng mắc hai bên cùng trao đổi để khắc phục. Nếu không giải quyết được bằng thương lượng thì một trong hai bên sẽ đưa ra Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội để giải quyết. Phán quyết của Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội là phán quyết cuối cùng để hai bên thực hiện, mọi chi phí phát sinh và án phí do bên có lỗi chịu trách nhiệm thanh toán.</li>\n <li>Hợp đồng này đ­ược lập thành ….. bản, mỗi bên giữ …. bản và có giá trị pháp lý nh­ư nhau.</li>\n</ul>\n\n<p><strong>                  ĐẠI DIỆN BÊN A                                              ĐẠI DIỆN BÊN B</strong></p>\n', 2),
(3, 'Hợp đồng kinh tế 2', '<p><strong>CỘNG HOÀ XÃ HỘI CHỦ NGHĨA VIỆT NAM</strong></p>\n\n<p>Độc lập - Tự do - Hạnh phúc</p>\n\n<p>-------------oOo-----------</p>\n\n<p> </p>\n\n<p><strong>HỢP ĐỒNG KINH TẾ</strong></p>\n\n<p><em>Số: ........../ 20…/ HĐKT</em></p>\n\n<p> </p>\n\n<p>   - Căn cứ Bộ luật Dân sự số 33/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào Luật Thương Mại số 36/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào nhu cầu, khả năng của hai bên.</p>\n\n<p>Hôm nay, ngày …..  tháng ….năm 2015  Chúng tôi gồm:</p>\n\n<p><strong>Bên A:   </strong>{TEN_NCC}</p>\n\n<ul>\n <li>Địa chỉ                    :     {DIA_CHI_NCC}</li>\n <li>Điện thoại               :     {SDT_NCC}</li>\n <li>Fax                           :     …………………………………………………………………</li>\n <li>CMTND                  :   …………CA Thành phố ………….… cấp ngày…………..…..</li>\n</ul>\n\n<p><strong>Bên B:   Công ty TNHH Công Nghệ Tự Động Hóa Minh Anh.</strong></p>\n\n<ul>\n <li>Địa chỉ                    :    Số 23 ngõ 389/4 Hoàng Quốc Việt – Quận Cầu Giấy -  Hà Nội.</li>\n <li>Điện thoại               :     +84 4–378 5885.</li>\n <li>Fax                           :     +84 4–378 5885.</li>\n <li>Mã số thuế                 :     0101130774.</li>\n <li>Đại diện bởi           :     Ông  <strong>Nguyễn Xuân Giang</strong></li>\n <li>Chức vụ                  :     Phó Giám đốc</li>\n <li>Tài khoản số          :     10820962715015</li>\n <li>Tại Ngân hàng        :     Ngân hàng TMCP Kỹ Thương – CN Hoàn Kiếm – Hà Nội</li>\n</ul>\n\n<p> </p>\n\n<p>Tại Trụ sở bên A, hai bên thỏa thuận ký kết hợp đồng kinh tế này với các điều khoản sau:</p>\n\n<p><strong><em>Điều 1:</em></strong><strong><em> Nội dung công việc</em></strong></p>\n\n<p>1.1. Bên B nhận cung cấp bằng nhập khẩu cho bên A  …… ( ….. ) thang máy tải khách (mã hiệu ………..), tải trọng …..kg (….. người ), tốc độ …… m/phút, ….. điểm dừng , xuất xứ ………, mới 100%, sản xuất năm ……. trở về sau.</p>\n\n<p><em>(Theo Bản Phụ lục Hợp đồng 1)</em></p>\n\n<p>1.2. Cung cấp vật tư lắp đặt và lắp đặt hoàn chỉnh thang máy trên tại công trình :</p>\n\n<p>“……………………………………………………………………………………………………………………………………………..……………”</p>\n\n<p><strong><em>Điều 2:</em></strong><strong><em> Trách nhiệm của bên A</em></strong></p>\n\n<ul>\n <li>Xây dựng, hiệu chỉnh hố thang đảm bảo các thông số kỹ thuật cho việc lắp đặt thang máy theo bản vẽ kỹ thuật hố thang do bên B cung cấp.</li>\n <li>Chậm nhất là trong vòng 5 ngày kể từ ngày bên B chuyển bản vẽ kỹ thuật, bên A phải ký xác nhận vào bản vẽ kỹ thuật sau khi đã thống nhất để Bên B đặt hàng với Hãng sản xuất. Quá thời hạn trên coi như bên A đã đồng ý với bản vẽ kỹ thuật mà bên B đã chuyển để hai bên thực hiện công việc.</li>\n <li>Bên A giao đầy đủ hồ sơ thiết kế liên quan đến hố thang máy cho Bên B.</li>\n <li>Cử cán bộ có trách nhiệm phối hợp cùng bên B tham gia kiểm tra và ký xác nhận thiết bị thang máy khi lô thiết bị được chuyển về chân công trình. Nếu tại thời điểm hàng về chân công trình, bên A không bố trí được người kiểm tra, bên B vẫn vận chuyển lô thiết bị trên vào kho và lô thiết bị trên coi như đã được kiểm tra đầy đủ, đúng theo danh mục hồ sơ thang máy kèm theo.</li>\n <li>Bố trí kho chứa thiết bị an toàn tại tầng một khi bên B vận chuyển thiết bị đến công trình và đảm bảo an ninh cho kho chứa thiết bị thang máy tại công trình.</li>\n <li>Bàn giao mặt bằng đủ điều kiện để thi công lắp đặt cho bên B đúng tiến độ.</li>\n <li>Cung cấp điểm đấu nối nguồn điện để thi công, lắp đặt thang máy trong khu vực thi công.</li>\n <li>Cung cấp nguồn điện 3 phase 380V/220V và 01 Aptomat 3 phase /1 thang và điểm đấu nối dây tiếp địa tại phòng đặt máy để bên B hiệu chỉnh thang máy .</li>\n <li>Bên A cử cán bộ kỹ thuật thường xuyên phối hợp cùng bên B trong suốt quá trình thi công lắp đặt để giải quyết kịp thời các công việc trong quá trình thực hiện hợp đồng.</li>\n <li> Tổ chức nghiệm thu, ký biên bản nghiệm thu giai đoạn (nếu có) và nghiệm thu bàn giao kịp thời khi bên B hoàn tất công việc.</li>\n <li>Thực hiện phần việc xây dựng hoàn thiện sau khi bên B hoàn tất lắp đặt thiết bị thang máy.</li>\n <li>Tạm ứng và thanh toán kịp thời cho Bên B theo điều 6 của Hợp đồng.</li>\n</ul>\n\n<p><strong><em>Điều 3:</em></strong><strong><em> Trách nhiệm của bên B</em></strong></p>\n\n<ul>\n <li>Khảo sát và thiết kế bản vẽ hố thang theo tiêu chuẩn và chuyển cho bên A ký xác nhận làm cơ sở đặt hàng với Hãng sản xuất và thực hiện các công việc liên quan.</li>\n <li>Nhập khẩu thiết bị thang máy theo các thông số kỹ thuật của Phụ lục số 01 về đặc tính kỹ thuật thang máy.</li>\n <li>Trước khi vận chuyển thiết bị về công trình, bên B có trách nhiệm thông báo cho bên A ngày thiết bị về đến công trình để bên A bố trí kho chứa thiết bị tại công trình.</li>\n <li>Vận chuyển thiết bị đến công trình,  phối hợp cùng với đại diện của bên A kiểm tra và ký xác nhận vào các biên bản.</li>\n <li>Cung cấp vật tư  lắp đặt và lắp đặt, hiệu chỉnh, đưa thang máy vào sử dụng.</li>\n <li>Có trách nhiệm mời cơ quan có chức năng, tổ chức kiểm định - cung cấp Biên bản kiểm định kỹ thuật an toàn thang máy của cơ quan Nhà nước có thẩm quyền đủ điều kiện an toàn sử dụng bàn giao cho bên A.</li>\n <li>Có trách nhiệm quản lý, đảm bảo an ninh, an toàn trong quá trình thi công trên công trình và giữ gìn vệ sinh môi trường trong suốt thời gian thi công.</li>\n <li>Đảm bảo và chịu trách nhiệm về các điều kiện an toàn cho con người, an ninh trong khu vực thi công theo quy định chung.</li>\n <li>Hướng dẫn cách sử dụng vận hành thang máy cho bên A.</li>\n <li>Bên B có trách nhiệm bảo hành công trình theo quy định tại điều 7 của Hợp đồng kinh tế.</li>\n</ul>\n\n<p><strong><em>Điều 4:</em></strong><strong><em> Tiến độ thực hiện được bên B thực hiện như sau:  </em></strong></p>\n\n<table border="0" cellpadding="0" cellspacing="0">\n <tbody>\n  <tr>\n   <td>\n   <p>4.1 Thời gian thiết bị thang máy đ­ược nhập khẩu và vận chuyển đến công trình kể từ ngày bên B nhận được kinh phí tạm ứng kỳ 1 và bên A xác nhận vào bản vẽ kỹ thuật hố thang là: …. tháng</p>\n   </td>\n  </tr>\n  <tr>\n   <td>\n   <p>4.2 Thời gian lắp đặt, hiệu chỉnh được thực hiện khi bên B nhận được kinh phí thanh toán kỳ 2, bên A bàn giao mặt bằng đầy đủ điều kiện thi công và ký biên bản nghiệm thu thiết bị trước khi lắp đặt là: ….. ngày</p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p>-   Tiến độ trên chỉ được thực hiện với các điều kiện sau:</p>\n\n<ul>\n <li>Bên A thanh toán đúng thời hạn và giá trị đã ghi ở điều 5 và điều 6 hợp đồng này.</li>\n <li>Các chi tiết kỹ thuật của thang máy phải được bên A thống nhất trước khi ký kết hợp đồng kinh tế. Trong trường hợp có những thay đổi về chi tiết kỹ thuật của thang máy từ phía bên A như bổ sung, bỏ bớt hoặc điều chỉnh thì hai bên thống thất bằng một văn bản hoặc phụ lục hợp đồng bổ sung để hiệu chỉnh giá trị hợp đồng và tiến độ thực hiện nhưng thời gian cho việc thay đổi trong vòng 30 ngày kể từ ngày hợp đồng có hiệu lực.</li>\n <li>Việc lắp đặt thang máy chỉ được tiến hành sau khi điều 4.2 đã được thực hiện .</li>\n</ul>\n\n<p><strong><em>Điều 5:</em></strong><strong><em>  Giá trị của hợp đồng kinh tế </em></strong></p>\n\n<ul>\n <li>Giá trị hợp đồng kinh tế cung cấp lắp đặt thang máy là: khoản tiền VNĐ có giá trị bảo đảm tương đương: <strong>………….. VND <em>(…………………….. VND</em></strong>) <strong>.</strong>             </li>\n</ul>\n\n<p><strong><em>               ( Bằng chữ: …………………………………………………………………. )</em></strong></p>\n\n<ul>\n <li><em>Giá trị hợp đồng trên đã bao gồm: giá thiết bị thang máy nhập khẩu về tới chân công trình, vật tư lắp đặt, chi phí lắp đặt, hiệu chỉnh, tổ chức kiểm định thang máy cấp giấy chứng nhận thang máy đủ điểu kiện an toàn sử dụng, chi phí bảo hành  và thuế GTGT.</em></li>\n</ul>\n\n<p><strong><em>Điều 6:</em></strong><strong><em> Ph­ương thức thanh toán </em></strong></p>\n\n<ul>\n <li>Bên A tạm ứng, thanh toán cho bên B theo các kỳ nh­ư sau:</li>\n</ul>\n\n<ul>\n <li>Kỳ 1: Tạm ứng <strong>40</strong>% tổng giá trị hợp đồng kinh tế ngay sau khi Hợp đồng kinh tế được ký kết.</li>\n</ul>\n\n<ul>\n <li>Kỳ 2: Thanh toán 5<strong>0%</strong> tổng giá trị hợp đồng kinh tế - không bao gồm giá trị đã tạm ứng kỳ 1 - trong vòng 7 ngày sau khi thiết bị thang máy đ­ược chuyển đến chân công trình.</li>\n <li>Kỳ 3: Thanh toán phần còn lại của tổng giá trị hợp đồng trong vòng 10 ngày kể từ ngày bên B hoàn tất việc lắp đặt và thang máy được kiểm định an toàn.</li>\n</ul>\n\n<ul>\n <li>Tr­ường hợp bên A không thực hiện đầy đủ nghĩa vụ thanh toán như­ đã thống nhất ở trên, bên B có quyền ngừng thực hiện các công việc liên quan đến thang máy cho đến khi bên A hoàn thành nghĩa vụ thanh toán của mình và đền bù những thiệt hại cho bên B theo lãi suất quá hạn cho vay của Ngân hàng bên B mở tài khoản.</li>\n <li>Trong trường hợp bên B đã hoàn thành toàn bộ công việc theo như hợp đồng kinh tế đã ký kết mà bên A chưa có nguồn điện chính thức để sử dụng thang máy, hoặc chưa có nhu cầu sử dụng thì trách nhiệm của bên A là phải hoàn thành nghĩa vụ thanh toán toàn bộ giá trị hợp đồng cho bên B để bên B quyết toán hợp đồng và thực hiện nghĩa vụ nộp thuế theo quy định của Nhà nước.</li>\n</ul>\n\n<p><strong><em>Điều 7 :</em></strong><strong><em> Bảo hành và Bảo trì</em></strong></p>\n\n<ul>\n <li>Bên B có trách nhiệm bảo hành thiết bị trong thời hạn 12 tháng kể từ ngày thang máy được kiểm định an toàn. Nếu trong thời gian bảo hành mà thang máy bị hư hỏng, nhận được thông báo của bên A trong thời gian sớm nhất bên B phải cử người đến xử lý và chịu mọi phí tổn sửa chữa nếu xảy ra sự cố kỹ thuật do lỗi của nhà sản xuất hoặc do lỗi khác của bên B.</li>\n <li>Bên B có trách nhiệm lập quy trình bảo trì cho công trình khi hết thời hạn bảo hành và hai bên sẽ thương thảo, ký kết hợp đồng bảo trì cho công trình.</li>\n</ul>\n\n<p><strong><em>Điều 8:</em></strong><strong><em>  Hiệu lực hợp đồng </em></strong></p>\n\n<ul>\n <li>Hợp đồng kinh tế này có hiệu lực kể từ ngày ký và không đư­ợc hủy ngang, nếu bên nào vi phạm thì sẽ đền bù cho bên còn lại 20% giá trị Hợp đồng kinh tế.</li>\n <li>Hai bên cam kết thực hiện đúng các điều khoản ghi trong hợp đồng kinh tế. Khi có  vướng mắc hai bên cùng trao đổi để khắc phục. Nếu không giải quyết được bằng thương lượng thì một trong hai bên sẽ đưa ra Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội để giải quyết. Phán quyết của Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội là phán quyết cuối cùng để hai bên thực hiện, mọi chi phí phát sinh và án phí do bên có lỗi chịu trách nhiệm thanh toán.</li>\n <li>Hợp đồng này đ­ược lập thành ….. bản, mỗi bên giữ …. bản và có giá trị pháp lý nh­ư nhau.</li>\n</ul>\n\n<p><strong>                  ĐẠI DIỆN BÊN A                                              ĐẠI DIỆN BÊN B</strong></p>\n', 1);
INSERT INTO `phppos_quotes_contract` (`id_quotes_contract`, `title_quotes_contract`, `content_quotes_contract`, `cat_quotes_contract`) VALUES
(4, 'Hợp đồng kinh tế', '<p><strong>CỘNG HOÀ XÃ HỘI CHỦ NGHĨA VIỆT NAM</strong></p>\n\n<p>Độc lập - Tự do - Hạnh phúc</p>\n\n<p>-------------oOo-----------</p>\n\n<p> </p>\n\n<p><strong>HỢP ĐỒNG KINH TẾ</strong></p>\n\n<p><em>Số: ........../ 20…/ HĐKT</em></p>\n\n<p> </p>\n\n<p>   - Căn cứ Bộ luật Dân sự số 33/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào Luật Thương Mại số 36/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào nhu cầu, khả năng của hai bên.</p>\n\n<p>Hôm nay, ngày …..  tháng ….năm 2015  Chúng tôi gồm:</p>\n\n<p><strong>Bên A:   </strong>{TEN_NCC}</p>\n\n<ul>\n <li>Địa chỉ                    :     {DIA_CHI_NCC}</li>\n <li>Điện thoại               :     {SDT_NCC}</li>\n <li>Fax                           :     …………………………………………………………………</li>\n <li>CMTND                  :   …………CA Thành phố ………….… cấp ngày…………..…..</li>\n</ul>\n\n<p><strong>Bên B:   Công ty TNHH Công Nghệ Tự Động Hóa Minh Anh.</strong></p>\n\n<ul>\n <li>Địa chỉ                    :    Số 23 ngõ 389/4 Hoàng Quốc Việt – Quận Cầu Giấy -  Hà Nội.</li>\n <li>Điện thoại               :     +84 4–378 5885.</li>\n <li>Fax                           :     +84 4–378 5885.</li>\n <li>Mã số thuế                 :     0101130774.</li>\n <li>Đại diện bởi           :     Ông  <strong>Nguyễn Xuân Giang</strong></li>\n <li>Chức vụ                  :     Phó Giám đốc</li>\n <li>Tài khoản số          :     10820962715015</li>\n <li>Tại Ngân hàng        :     Ngân hàng TMCP Kỹ Thương – CN Hoàn Kiếm – Hà Nội</li>\n</ul>\n\n<p> </p>\n\n<p>Tại Trụ sở bên A, hai bên thỏa thuận ký kết hợp đồng kinh tế này với các điều khoản sau:</p>\n\n<p><strong><em>Điều 1:</em></strong><strong><em> Nội dung công việc</em></strong></p>\n\n<p>1.1. Bên B nhận cung cấp bằng nhập khẩu cho bên A  …… ( ….. ) thang máy tải khách (mã hiệu ………..), tải trọng …..kg (….. người ), tốc độ …… m/phút, ….. điểm dừng , xuất xứ ………, mới 100%, sản xuất năm ……. trở về sau.</p>\n\n<p><em>(Theo Bản Phụ lục Hợp đồng 1)</em></p>\n\n<p>1.2. Cung cấp vật tư lắp đặt và lắp đặt hoàn chỉnh thang máy trên tại công trình :</p>\n\n<p>“……………………………………………………………………………………………………………………………………………..……………”</p>\n\n<p>{TABLE_DATA}</p>\n\n<p><strong><em>Điều 2:</em></strong><strong><em> Trách nhiệm của bên A</em></strong></p>\n\n<ul>\n <li>Xây dựng, hiệu chỉnh hố thang đảm bảo các thông số kỹ thuật cho việc lắp đặt thang máy theo bản vẽ kỹ thuật hố thang do bên B cung cấp.</li>\n <li>Chậm nhất là trong vòng 5 ngày kể từ ngày bên B chuyển bản vẽ kỹ thuật, bên A phải ký xác nhận vào bản vẽ kỹ thuật sau khi đã thống nhất để Bên B đặt hàng với Hãng sản xuất. Quá thời hạn trên coi như bên A đã đồng ý với bản vẽ kỹ thuật mà bên B đã chuyển để hai bên thực hiện công việc.</li>\n <li>Bên A giao đầy đủ hồ sơ thiết kế liên quan đến hố thang máy cho Bên B.</li>\n <li>Cử cán bộ có trách nhiệm phối hợp cùng bên B tham gia kiểm tra và ký xác nhận thiết bị thang máy khi lô thiết bị được chuyển về chân công trình. Nếu tại thời điểm hàng về chân công trình, bên A không bố trí được người kiểm tra, bên B vẫn vận chuyển lô thiết bị trên vào kho và lô thiết bị trên coi như đã được kiểm tra đầy đủ, đúng theo danh mục hồ sơ thang máy kèm theo.</li>\n <li>Bố trí kho chứa thiết bị an toàn tại tầng một khi bên B vận chuyển thiết bị đến công trình và đảm bảo an ninh cho kho chứa thiết bị thang máy tại công trình.</li>\n <li>Bàn giao mặt bằng đủ điều kiện để thi công lắp đặt cho bên B đúng tiến độ.</li>\n <li>Cung cấp điểm đấu nối nguồn điện để thi công, lắp đặt thang máy trong khu vực thi công.</li>\n <li>Cung cấp nguồn điện 3 phase 380V/220V và 01 Aptomat 3 phase /1 thang và điểm đấu nối dây tiếp địa tại phòng đặt máy để bên B hiệu chỉnh thang máy .</li>\n <li>Bên A cử cán bộ kỹ thuật thường xuyên phối hợp cùng bên B trong suốt quá trình thi công lắp đặt để giải quyết kịp thời các công việc trong quá trình thực hiện hợp đồng.</li>\n <li> Tổ chức nghiệm thu, ký biên bản nghiệm thu giai đoạn (nếu có) và nghiệm thu bàn giao kịp thời khi bên B hoàn tất công việc.</li>\n <li>Thực hiện phần việc xây dựng hoàn thiện sau khi bên B hoàn tất lắp đặt thiết bị thang máy.</li>\n <li>Tạm ứng và thanh toán kịp thời cho Bên B theo điều 6 của Hợp đồng.</li>\n</ul>\n\n<p><strong><em>Điều 3:</em></strong><strong><em> Trách nhiệm của bên B</em></strong></p>\n\n<ul>\n <li>Khảo sát và thiết kế bản vẽ hố thang theo tiêu chuẩn và chuyển cho bên A ký xác nhận làm cơ sở đặt hàng với Hãng sản xuất và thực hiện các công việc liên quan.</li>\n <li>Nhập khẩu thiết bị thang máy theo các thông số kỹ thuật của Phụ lục số 01 về đặc tính kỹ thuật thang máy.</li>\n <li>Trước khi vận chuyển thiết bị về công trình, bên B có trách nhiệm thông báo cho bên A ngày thiết bị về đến công trình để bên A bố trí kho chứa thiết bị tại công trình.</li>\n <li>Vận chuyển thiết bị đến công trình,  phối hợp cùng với đại diện của bên A kiểm tra và ký xác nhận vào các biên bản.</li>\n <li>Cung cấp vật tư  lắp đặt và lắp đặt, hiệu chỉnh, đưa thang máy vào sử dụng.</li>\n <li>Có trách nhiệm mời cơ quan có chức năng, tổ chức kiểm định - cung cấp Biên bản kiểm định kỹ thuật an toàn thang máy của cơ quan Nhà nước có thẩm quyền đủ điều kiện an toàn sử dụng bàn giao cho bên A.</li>\n <li>Có trách nhiệm quản lý, đảm bảo an ninh, an toàn trong quá trình thi công trên công trình và giữ gìn vệ sinh môi trường trong suốt thời gian thi công.</li>\n <li>Đảm bảo và chịu trách nhiệm về các điều kiện an toàn cho con người, an ninh trong khu vực thi công theo quy định chung.</li>\n <li>Hướng dẫn cách sử dụng vận hành thang máy cho bên A.</li>\n <li>Bên B có trách nhiệm bảo hành công trình theo quy định tại điều 7 của Hợp đồng kinh tế.</li>\n</ul>\n\n<p><strong><em>Điều 4:</em></strong><strong><em> Tiến độ thực hiện được bên B thực hiện như sau:  </em></strong></p>\n\n<table border="0" cellpadding="0" cellspacing="0">\n <tbody>\n  <tr>\n   <td>\n   <p>4.1 Thời gian thiết bị thang máy đ­ược nhập khẩu và vận chuyển đến công trình kể từ ngày bên B nhận được kinh phí tạm ứng kỳ 1 và bên A xác nhận vào bản vẽ kỹ thuật hố thang là: …. tháng</p>\n   </td>\n  </tr>\n  <tr>\n   <td>\n   <p>4.2 Thời gian lắp đặt, hiệu chỉnh được thực hiện khi bên B nhận được kinh phí thanh toán kỳ 2, bên A bàn giao mặt bằng đầy đủ điều kiện thi công và ký biên bản nghiệm thu thiết bị trước khi lắp đặt là: ….. ngày</p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p>-   Tiến độ trên chỉ được thực hiện với các điều kiện sau:</p>\n\n<ul>\n <li>Bên A thanh toán đúng thời hạn và giá trị đã ghi ở điều 5 và điều 6 hợp đồng này.</li>\n <li>Các chi tiết kỹ thuật của thang máy phải được bên A thống nhất trước khi ký kết hợp đồng kinh tế. Trong trường hợp có những thay đổi về chi tiết kỹ thuật của thang máy từ phía bên A như bổ sung, bỏ bớt hoặc điều chỉnh thì hai bên thống thất bằng một văn bản hoặc phụ lục hợp đồng bổ sung để hiệu chỉnh giá trị hợp đồng và tiến độ thực hiện nhưng thời gian cho việc thay đổi trong vòng 30 ngày kể từ ngày hợp đồng có hiệu lực.</li>\n <li>Việc lắp đặt thang máy chỉ được tiến hành sau khi điều 4.2 đã được thực hiện .</li>\n</ul>\n\n<p><strong><em>Điều 5:</em></strong><strong><em>  Giá trị của hợp đồng kinh tế </em></strong></p>\n\n<ul>\n <li>Giá trị hợp đồng kinh tế cung cấp lắp đặt thang máy là: khoản tiền VNĐ có giá trị bảo đảm tương đương: <strong>………….. VND <em>(…………………….. VND</em></strong>) <strong>.</strong>             </li>\n</ul>\n\n<p><strong><em>               ( Bằng chữ: …………………………………………………………………. )</em></strong></p>\n\n<ul>\n <li><em>Giá trị hợp đồng trên đã bao gồm: giá thiết bị thang máy nhập khẩu về tới chân công trình, vật tư lắp đặt, chi phí lắp đặt, hiệu chỉnh, tổ chức kiểm định thang máy cấp giấy chứng nhận thang máy đủ điểu kiện an toàn sử dụng, chi phí bảo hành  và thuế GTGT.</em></li>\n</ul>\n\n<p><strong><em>Điều 6:</em></strong><strong><em> Ph­ương thức thanh toán </em></strong></p>\n\n<ul>\n <li>Bên A tạm ứng, thanh toán cho bên B theo các kỳ nh­ư sau:</li>\n</ul>\n\n<ul>\n <li>Kỳ 1: Tạm ứng <strong>40</strong>% tổng giá trị hợp đồng kinh tế ngay sau khi Hợp đồng kinh tế được ký kết.</li>\n</ul>\n\n<ul>\n <li>Kỳ 2: Thanh toán 5<strong>0%</strong> tổng giá trị hợp đồng kinh tế - không bao gồm giá trị đã tạm ứng kỳ 1 - trong vòng 7 ngày sau khi thiết bị thang máy đ­ược chuyển đến chân công trình.</li>\n <li>Kỳ 3: Thanh toán phần còn lại của tổng giá trị hợp đồng trong vòng 10 ngày kể từ ngày bên B hoàn tất việc lắp đặt và thang máy được kiểm định an toàn.</li>\n</ul>\n\n<ul>\n <li>Tr­ường hợp bên A không thực hiện đầy đủ nghĩa vụ thanh toán như­ đã thống nhất ở trên, bên B có quyền ngừng thực hiện các công việc liên quan đến thang máy cho đến khi bên A hoàn thành nghĩa vụ thanh toán của mình và đền bù những thiệt hại cho bên B theo lãi suất quá hạn cho vay của Ngân hàng bên B mở tài khoản.</li>\n <li>Trong trường hợp bên B đã hoàn thành toàn bộ công việc theo như hợp đồng kinh tế đã ký kết mà bên A chưa có nguồn điện chính thức để sử dụng thang máy, hoặc chưa có nhu cầu sử dụng thì trách nhiệm của bên A là phải hoàn thành nghĩa vụ thanh toán toàn bộ giá trị hợp đồng cho bên B để bên B quyết toán hợp đồng và thực hiện nghĩa vụ nộp thuế theo quy định của Nhà nước.</li>\n</ul>\n\n<p><strong><em>Điều 7 :</em></strong><strong><em> Bảo hành và Bảo trì</em></strong></p>\n\n<ul>\n <li>Bên B có trách nhiệm bảo hành thiết bị trong thời hạn 12 tháng kể từ ngày thang máy được kiểm định an toàn. Nếu trong thời gian bảo hành mà thang máy bị hư hỏng, nhận được thông báo của bên A trong thời gian sớm nhất bên B phải cử người đến xử lý và chịu mọi phí tổn sửa chữa nếu xảy ra sự cố kỹ thuật do lỗi của nhà sản xuất hoặc do lỗi khác của bên B.</li>\n <li>Bên B có trách nhiệm lập quy trình bảo trì cho công trình khi hết thời hạn bảo hành và hai bên sẽ thương thảo, ký kết hợp đồng bảo trì cho công trình.</li>\n</ul>\n\n<p><strong><em>Điều 8:</em></strong><strong><em>  Hiệu lực hợp đồng </em></strong></p>\n\n<ul>\n <li>Hợp đồng kinh tế này có hiệu lực kể từ ngày ký và không đư­ợc hủy ngang, nếu bên nào vi phạm thì sẽ đền bù cho bên còn lại 20% giá trị Hợp đồng kinh tế.</li>\n <li>Hai bên cam kết thực hiện đúng các điều khoản ghi trong hợp đồng kinh tế. Khi có  vướng mắc hai bên cùng trao đổi để khắc phục. Nếu không giải quyết được bằng thương lượng thì một trong hai bên sẽ đưa ra Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội để giải quyết. Phán quyết của Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội là phán quyết cuối cùng để hai bên thực hiện, mọi chi phí phát sinh và án phí do bên có lỗi chịu trách nhiệm thanh toán.</li>\n <li>Hợp đồng này đ­ược lập thành ….. bản, mỗi bên giữ …. bản và có giá trị pháp lý nh­ư nhau.</li>\n</ul>\n\n<p><strong>                  ĐẠI DIỆN BÊN A                                              ĐẠI DIỆN BÊN B</strong></p>\n', 2),
(5, 'Hợp đồng kinh tế 3', '<p><strong>CỘNG HOÀ XÃ HỘI CHỦ NGHĨA VIỆT NAM</strong></p>\n\n<p>Độc lập - Tự do - Hạnh phúc</p>\n\n<p>-------------oOo-----------</p>\n\n<p> </p>\n\n<p><strong>HỢP ĐỒNG KINH TẾ</strong></p>\n\n<p><em>Số: ........../ 20…/ HĐKT</em></p>\n\n<p> </p>\n\n<p>   - Căn cứ Bộ luật Dân sự số 33/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào Luật Thương Mại số 36/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào nhu cầu, khả năng của hai bên.</p>\n\n<p>Hôm nay, ngày …..  tháng ….năm 2015  Chúng tôi gồm:</p>\n\n<p><strong>Bên A:   </strong>{TEN_NCC}</p>\n\n<ul>\n <li>Địa chỉ                    :     {DIA_CHI_NCC}</li>\n <li>Điện thoại               :     {SDT_NCC}</li>\n <li>Fax                           :     …………………………………………………………………</li>\n <li>CMTND                  :   …………CA Thành phố ………….… cấp ngày…………..…..</li>\n</ul>\n\n<p><strong>Bên B:   Công ty TNHH Công Nghệ Tự Động Hóa Minh Anh.</strong></p>\n\n<ul>\n <li>Địa chỉ                    :    Số 23 ngõ 389/4 Hoàng Quốc Việt – Quận Cầu Giấy -  Hà Nội.</li>\n <li>Điện thoại               :     +84 4–378 5885.</li>\n <li>Fax                           :     +84 4–378 5885.</li>\n <li>Mã số thuế                 :     0101130774.</li>\n <li>Đại diện bởi           :     Ông  <strong>Nguyễn Xuân Giang</strong></li>\n <li>Chức vụ                  :     Phó Giám đốc</li>\n <li>Tài khoản số          :     10820962715015</li>\n <li>Tại Ngân hàng        :     Ngân hàng TMCP Kỹ Thương – CN Hoàn Kiếm – Hà Nội</li>\n</ul>\n\n<p> </p>\n\n<p>Tại Trụ sở bên A, hai bên thỏa thuận ký kết hợp đồng kinh tế này với các điều khoản sau:</p>\n\n<p><strong><em>Điều 1:</em></strong><strong><em> Nội dung công việc</em></strong></p>\n\n<p>1.1. Bên B nhận cung cấp bằng nhập khẩu cho bên A  …… ( ….. ) thang máy tải khách (mã hiệu ………..), tải trọng …..kg (….. người ), tốc độ …… m/phút, ….. điểm dừng , xuất xứ ………, mới 100%, sản xuất năm ……. trở về sau.</p>\n\n<p><em>(Theo Bản Phụ lục Hợp đồng 1)</em></p>\n\n<p>1.2. Cung cấp vật tư lắp đặt và lắp đặt hoàn chỉnh thang máy trên tại công trình :</p>\n\n<p>“……………………………………………………………………………………………………………………………………………..……………”</p>\n\n<p> </p>\n\n<p>{TABLE_DATA}</p>\n\n<p> </p>\n\n<p><strong><em>Điều 2:</em></strong><strong><em> Trách nhiệm của bên A</em></strong></p>\n\n<ul>\n <li>Xây dựng, hiệu chỉnh hố thang đảm bảo các thông số kỹ thuật cho việc lắp đặt thang máy theo bản vẽ kỹ thuật hố thang do bên B cung cấp.</li>\n <li>Chậm nhất là trong vòng 5 ngày kể từ ngày bên B chuyển bản vẽ kỹ thuật, bên A phải ký xác nhận vào bản vẽ kỹ thuật sau khi đã thống nhất để Bên B đặt hàng với Hãng sản xuất. Quá thời hạn trên coi như bên A đã đồng ý với bản vẽ kỹ thuật mà bên B đã chuyển để hai bên thực hiện công việc.</li>\n <li>Bên A giao đầy đủ hồ sơ thiết kế liên quan đến hố thang máy cho Bên B.</li>\n <li>Cử cán bộ có trách nhiệm phối hợp cùng bên B tham gia kiểm tra và ký xác nhận thiết bị thang máy khi lô thiết bị được chuyển về chân công trình. Nếu tại thời điểm hàng về chân công trình, bên A không bố trí được người kiểm tra, bên B vẫn vận chuyển lô thiết bị trên vào kho và lô thiết bị trên coi như đã được kiểm tra đầy đủ, đúng theo danh mục hồ sơ thang máy kèm theo.</li>\n <li>Bố trí kho chứa thiết bị an toàn tại tầng một khi bên B vận chuyển thiết bị đến công trình và đảm bảo an ninh cho kho chứa thiết bị thang máy tại công trình.</li>\n <li>Bàn giao mặt bằng đủ điều kiện để thi công lắp đặt cho bên B đúng tiến độ.</li>\n <li>Cung cấp điểm đấu nối nguồn điện để thi công, lắp đặt thang máy trong khu vực thi công.</li>\n <li>Cung cấp nguồn điện 3 phase 380V/220V và 01 Aptomat 3 phase /1 thang và điểm đấu nối dây tiếp địa tại phòng đặt máy để bên B hiệu chỉnh thang máy .</li>\n <li>Bên A cử cán bộ kỹ thuật thường xuyên phối hợp cùng bên B trong suốt quá trình thi công lắp đặt để giải quyết kịp thời các công việc trong quá trình thực hiện hợp đồng.</li>\n <li> Tổ chức nghiệm thu, ký biên bản nghiệm thu giai đoạn (nếu có) và nghiệm thu bàn giao kịp thời khi bên B hoàn tất công việc.</li>\n <li>Thực hiện phần việc xây dựng hoàn thiện sau khi bên B hoàn tất lắp đặt thiết bị thang máy.</li>\n <li>Tạm ứng và thanh toán kịp thời cho Bên B theo điều 6 của Hợp đồng.</li>\n</ul>\n\n<p><strong><em>Điều 3:</em></strong><strong><em> Trách nhiệm của bên B</em></strong></p>\n\n<ul>\n <li>Khảo sát và thiết kế bản vẽ hố thang theo tiêu chuẩn và chuyển cho bên A ký xác nhận làm cơ sở đặt hàng với Hãng sản xuất và thực hiện các công việc liên quan.</li>\n <li>Nhập khẩu thiết bị thang máy theo các thông số kỹ thuật của Phụ lục số 01 về đặc tính kỹ thuật thang máy.</li>\n <li>Trước khi vận chuyển thiết bị về công trình, bên B có trách nhiệm thông báo cho bên A ngày thiết bị về đến công trình để bên A bố trí kho chứa thiết bị tại công trình.</li>\n <li>Vận chuyển thiết bị đến công trình,  phối hợp cùng với đại diện của bên A kiểm tra và ký xác nhận vào các biên bản.</li>\n <li>Cung cấp vật tư  lắp đặt và lắp đặt, hiệu chỉnh, đưa thang máy vào sử dụng.</li>\n <li>Có trách nhiệm mời cơ quan có chức năng, tổ chức kiểm định - cung cấp Biên bản kiểm định kỹ thuật an toàn thang máy của cơ quan Nhà nước có thẩm quyền đủ điều kiện an toàn sử dụng bàn giao cho bên A.</li>\n <li>Có trách nhiệm quản lý, đảm bảo an ninh, an toàn trong quá trình thi công trên công trình và giữ gìn vệ sinh môi trường trong suốt thời gian thi công.</li>\n <li>Đảm bảo và chịu trách nhiệm về các điều kiện an toàn cho con người, an ninh trong khu vực thi công theo quy định chung.</li>\n <li>Hướng dẫn cách sử dụng vận hành thang máy cho bên A.</li>\n <li>Bên B có trách nhiệm bảo hành công trình theo quy định tại điều 7 của Hợp đồng kinh tế.</li>\n</ul>\n\n<p><strong><em>Điều 4:</em></strong><strong><em> Tiến độ thực hiện được bên B thực hiện như sau:  </em></strong></p>\n\n<table border="0" cellpadding="0" cellspacing="0">\n <tbody>\n  <tr>\n   <td>\n   <p>4.1 Thời gian thiết bị thang máy đ­ược nhập khẩu và vận chuyển đến công trình kể từ ngày bên B nhận được kinh phí tạm ứng kỳ 1 và bên A xác nhận vào bản vẽ kỹ thuật hố thang là: …. tháng</p>\n   </td>\n  </tr>\n  <tr>\n   <td>\n   <p>4.2 Thời gian lắp đặt, hiệu chỉnh được thực hiện khi bên B nhận được kinh phí thanh toán kỳ 2, bên A bàn giao mặt bằng đầy đủ điều kiện thi công và ký biên bản nghiệm thu thiết bị trước khi lắp đặt là: ….. ngày</p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p>-   Tiến độ trên chỉ được thực hiện với các điều kiện sau:</p>\n\n<ul>\n <li>Bên A thanh toán đúng thời hạn và giá trị đã ghi ở điều 5 và điều 6 hợp đồng này.</li>\n <li>Các chi tiết kỹ thuật của thang máy phải được bên A thống nhất trước khi ký kết hợp đồng kinh tế. Trong trường hợp có những thay đổi về chi tiết kỹ thuật của thang máy từ phía bên A như bổ sung, bỏ bớt hoặc điều chỉnh thì hai bên thống thất bằng một văn bản hoặc phụ lục hợp đồng bổ sung để hiệu chỉnh giá trị hợp đồng và tiến độ thực hiện nhưng thời gian cho việc thay đổi trong vòng 30 ngày kể từ ngày hợp đồng có hiệu lực.</li>\n <li>Việc lắp đặt thang máy chỉ được tiến hành sau khi điều 4.2 đã được thực hiện .</li>\n</ul>\n\n<p><strong><em>Điều 5:</em></strong><strong><em>  Giá trị của hợp đồng kinh tế </em></strong></p>\n\n<ul>\n <li>Giá trị hợp đồng kinh tế cung cấp lắp đặt thang máy là: khoản tiền VNĐ có giá trị bảo đảm tương đương: <strong>………….. VND <em>(…………………….. VND</em></strong>) <strong>.</strong>             </li>\n</ul>\n\n<p><strong><em>               ( Bằng chữ: …………………………………………………………………. )</em></strong></p>\n\n<ul>\n <li><em>Giá trị hợp đồng trên đã bao gồm: giá thiết bị thang máy nhập khẩu về tới chân công trình, vật tư lắp đặt, chi phí lắp đặt, hiệu chỉnh, tổ chức kiểm định thang máy cấp giấy chứng nhận thang máy đủ điểu kiện an toàn sử dụng, chi phí bảo hành  và thuế GTGT.</em></li>\n</ul>\n\n<p><strong><em>Điều 6:</em></strong><strong><em> Ph­ương thức thanh toán </em></strong></p>\n\n<ul>\n <li>Bên A tạm ứng, thanh toán cho bên B theo các kỳ nh­ư sau:</li>\n</ul>\n\n<ul>\n <li>Kỳ 1: Tạm ứng <strong>40</strong>% tổng giá trị hợp đồng kinh tế ngay sau khi Hợp đồng kinh tế được ký kết.</li>\n</ul>\n\n<ul>\n <li>Kỳ 2: Thanh toán 5<strong>0%</strong> tổng giá trị hợp đồng kinh tế - không bao gồm giá trị đã tạm ứng kỳ 1 - trong vòng 7 ngày sau khi thiết bị thang máy đ­ược chuyển đến chân công trình.</li>\n <li>Kỳ 3: Thanh toán phần còn lại của tổng giá trị hợp đồng trong vòng 10 ngày kể từ ngày bên B hoàn tất việc lắp đặt và thang máy được kiểm định an toàn.</li>\n</ul>\n\n<ul>\n <li>Tr­ường hợp bên A không thực hiện đầy đủ nghĩa vụ thanh toán như­ đã thống nhất ở trên, bên B có quyền ngừng thực hiện các công việc liên quan đến thang máy cho đến khi bên A hoàn thành nghĩa vụ thanh toán của mình và đền bù những thiệt hại cho bên B theo lãi suất quá hạn cho vay của Ngân hàng bên B mở tài khoản.</li>\n <li>Trong trường hợp bên B đã hoàn thành toàn bộ công việc theo như hợp đồng kinh tế đã ký kết mà bên A chưa có nguồn điện chính thức để sử dụng thang máy, hoặc chưa có nhu cầu sử dụng thì trách nhiệm của bên A là phải hoàn thành nghĩa vụ thanh toán toàn bộ giá trị hợp đồng cho bên B để bên B quyết toán hợp đồng và thực hiện nghĩa vụ nộp thuế theo quy định của Nhà nước.</li>\n</ul>\n\n<p><strong><em>Điều 7 :</em></strong><strong><em> Bảo hành và Bảo trì</em></strong></p>\n\n<ul>\n <li>Bên B có trách nhiệm bảo hành thiết bị trong thời hạn 12 tháng kể từ ngày thang máy được kiểm định an toàn. Nếu trong thời gian bảo hành mà thang máy bị hư hỏng, nhận được thông báo của bên A trong thời gian sớm nhất bên B phải cử người đến xử lý và chịu mọi phí tổn sửa chữa nếu xảy ra sự cố kỹ thuật do lỗi của nhà sản xuất hoặc do lỗi khác của bên B.</li>\n <li>Bên B có trách nhiệm lập quy trình bảo trì cho công trình khi hết thời hạn bảo hành và hai bên sẽ thương thảo, ký kết hợp đồng bảo trì cho công trình.</li>\n</ul>\n\n<p><strong><em>Điều 8:</em></strong><strong><em>  Hiệu lực hợp đồng </em></strong></p>\n\n<ul>\n <li>Hợp đồng kinh tế này có hiệu lực kể từ ngày ký và không đư­ợc hủy ngang, nếu bên nào vi phạm thì sẽ đền bù cho bên còn lại 20% giá trị Hợp đồng kinh tế.</li>\n <li>Hai bên cam kết thực hiện đúng các điều khoản ghi trong hợp đồng kinh tế. Khi có  vướng mắc hai bên cùng trao đổi để khắc phục. Nếu không giải quyết được bằng thương lượng thì một trong hai bên sẽ đưa ra Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội để giải quyết. Phán quyết của Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội là phán quyết cuối cùng để hai bên thực hiện, mọi chi phí phát sinh và án phí do bên có lỗi chịu trách nhiệm thanh toán.</li>\n <li>Hợp đồng này đ­ược lập thành ….. bản, mỗi bên giữ …. bản và có giá trị pháp lý nh­ư nhau.</li>\n</ul>\n\n<p><strong>                  ĐẠI DIỆN BÊN A                                              ĐẠI DIỆN BÊN B</strong></p>\n', 1);
