(6, 'Hợp đồng phần mềm', '<table border="0" cellpadding="0" cellspacing="0" xss=removed>\n <tbody>\n  <tr>\n   <td xss=removed>\n   <p>CÔNG TY TNHH CÔNG NGHỆ ĐIỆN TỬ PHẦN MỀM VÀ VIỄN THÔNG LIFETEK</p>\n   </td>\n   <td xss=removed>\n   <p><strong>CỘNG HÒA XÃ HỘI CHỦ NGHĨA VIỆT NAM</strong></p>\n\n   <p>Độc lập – Tự do – Hạnh phúc</p>\n\n   <p>----------&&&---------</p>\n\n   <p> </p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p><strong>            </strong><strong>HỢP ĐỒNG KINH TẾ</strong></p>\n\n<p><strong>CHUYỂN GIAO PHẦN MỀM 4 BIZ</strong></p>\n\n<p> </p>\n\n<table cellpadding="0" cellspacing="0" xss=removed>\n <tbody>\n  <tr>\n   <td>\n   <p><strong><em>Số:</em></strong><strong><em>  4Biz072016 005/HDKT/LT-Bparis</em></strong></p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p>                                                                                                                                                           </p>\n\n<p> </p>\n\n<p> </p>\n\n<p> </p>\n\n<ul>\n <li><em>Căn cứ Luật Thương mại đã được Quốc hội nước Cộng hòa xã hội chủ nghĩa Việt Nam khóa XI, kỳ họp thứ 7 thông qua ngày 14 tháng 6 năm 2005;</em></li>\n <li><em>Căn cứ Bộ Luật Dân sự này đã được Quốc hội nước Cộng hòa xã hội chủ nghĩa Việt Nam khóa XI, kỳ họp thứ 7 thông qua ngày 14 tháng 6 năm 2005;</em></li>\n <li><em>Căn</em><em> cứ nhu cầu và khả năng cung cấp hai bên ký hợp đồng</em>.</li>\n</ul>\n\n<p><em>Hôm nay, ngày     tháng 07 năm 2016 chúng tôi gồm: </em></p>\n\n<table border="0" cellpadding="0" cellspacing="0" xss=removed>\n <tbody>\n  <tr>\n   <td xss=removed>\n   <p><strong>BÊN A</strong></p>\n   </td>\n   <td colspan="3" xss=removed>\n   <p>:</p>\n   </td>\n   <td>\n   <p> </p>\n   </td>\n  </tr>\n  <tr>\n   <td xss=removed>\n   <p>Địa chỉ</p>\n   </td>\n   <td colspan="3" xss=removed>\n   <p>:</p>\n   </td>\n   <td>\n   <p> </p>\n   </td>\n  </tr>\n  <tr>\n   <td xss=removed>\n   <p>Đại diện</p>\n   </td>\n   <td colspan="3" xss=removed>\n   <p>:                    