d>\n  </tr>\n  <tr>\n   <td rowspan="2" xss=removed>\n   <p>01</p>\n   </td>\n   <td xss=removed>\n   <p>Phí đăng ký và duy trì hosting<ins> phần mềm </ins>4Biz <a href="http://mys.lifetek.vn">http://</a>Bparis.4biz.vn</p>\n   </td>\n   <td xss=removed>\n   <p>240,000</p>\n   </td>\n   <td xss=removed>\n   <p>200,000</p>\n   </td>\n   <td xss=removed>\n   <p>12</p>\n   </td>\n   <td xss=removed>\n   <p><strong><s>2,400,000</s></strong></p>\n   </td>\n   <td xss=removed>\n   <p><em>Miễn phí</em></p>\n   </td>\n  </tr>\n  <tr>\n   <td xss=removed>\n   <p>Phí đăng ký phần mềm bán hàng trực tuyến </p>\n\n   <p><a href="http://mys.lifetek.vn">http://</a>Bparis.4biz.vn</p>\n   </td>\n   <td xss=removed>\n   <p>850,000</p>\n   </td>\n   <td xss=removed>\n   <p>600,000</p>\n   </td>\n   <td xss=removed>\n   <p>12</p>\n   </td>\n   <td xss=removed>\n   <p><strong>7,200,000</strong></p>\n   </td>\n   <td xss=removed>\n   <p><em>Thanh toán theo năm</em></p>\n   </td>\n  </tr>\n  <tr>\n   <td colspan="5" xss=removed>\n   <p><strong>TỔNG CỘNG: </strong></p>\n   </td>\n   <td xss=removed>\n   <p><strong>7,200,000</strong></p>\n   </td>\n   <td xss=removed>\n   <p> </p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p><strong><em>Bằng chữ: Bảy triệu hai trăm ngàn đồng chẵn ./.</em></strong></p>\n\n<p><strong>ĐIỀU 3: GIAO HÀNG </strong></p>\n\n<ul>\n <li>Thời gian chuyển giao phiên bản mặc định: Ngày    / 07 /2016</li>\n <li>Chuyển giao phiên bản hoàn chỉnh theo các yêu cầu của Điều 1; từ 10 đến 12 ngày làm việc tính từ thời điểm bàn giao phiên bản mặc định,  không tính thời gian chờ phê duyệt nghiệp vụ của bên A</li>\n <li>Hình thức chuyển giao: Hướng dẫn sử dụng, tên miền truy cập và tài khoản quản trị.</li>\n <li>Thời gian triển khai : không quá 50 ngày làm việc kể từ khi bên B nhận được khoản thanh toán tạm ứng, thời gian làm việc không kể thứ 7 và chủ nhật, các ngày nghỉ lễ.</li>\n <li>Các bước triển khai hợp đồng như sau :</li>\n</ul>\n\n<p>+ Bước 1 : Bên B tiến hành triển khai và bàn giao hệ thống phần mềm cho Bên A trong thời gian: 01- 03 ngày ngay sau khi ký hợp đồng,</p>\n\n<p>+ Bước 2 : Bên B tiến hành hướng dẫn sử dụng và hỗ trợ sử dụng hệ thống phần mềm từ 03 – 05 ngày khi đã bàn giao hệ thống.</p>\n\n<ul>\n <li>Tên miền: <a href="http://          .lifetek.vn "> http://Bparis.4biz.vn </a>(tên miền có thể thay đổi cho phù hợp theo từng điểm đặt phần mềm của bên A)</li>\n <li>User/pass : admin/ 12345678</li>\n</ul>\n\n<p><strong>ĐIỀU </strong><strong>4</strong><strong>: BẢO HÀNH VÀ TƯ VẤN</strong></p>\n\n<ul xss=removed>\n <li><em>BẢO HÀNH</em></li>\n</ul>\n\n<ul>\n <li>Bên B chịu trách nhiệm bảo hành sản phẩm trong suốt thời gian sử dụng dịch vụ tính từ ngày ký kết hợp  đồng chuyển giao.</li>\n <li>Bên B chịu bảo hành các lỗi gặp phải khi vận hành phần mềm đúng như yêu cầu đặt hàng phần mềm của bên A.</li>\n <li>Bên B không chịu trách nhiệm bảo hành các lỗi do thiết bị phần cứng gây ra, các lỗi do người sử dụng vô tình hay cố ý gây ra khi vận hành phần mềm không đúng với tài liệu hướng dẫn sử dụng. Bên B không chịu trách nhiệm bảo hành tính pháp lý của số liệu kế toán trong phần mềm. Bên B không chịu trách nhiệm bảo hành phần mềm trong các trường hợp sự cố gây ra do thiên tai: lũ lụt, động đất, sét đánh, hỏa hoạn, mất trộm, mất điện.</li>\n</ul>\n\n<ul xss=removed>\n <li><em>TƯ VẤN</em></li>\n</ul>\n\n<ul>\n <li>Bên B chịu trách nhiệm hướng dẫn sử dụng thành thạo (miễn phí) cho các nhân  viên của bên A thông qua email, remote.</li>\n <li>Bên B chịu trách nhiệm tư vấn trong suốt quá trình sử dụng phần mềm thông qua hệ thống fax, e-mail, điện thoại, chuyển phát thư.</li>\n <li>Khi gặp sự cố trong quá trình sử dụng trong giờ làm việc (từ 8:00AM đến 5:30PM), người sử dụng liên lạc với Phòng tư vấn theo địa chỉ e-mail: <a href="mailto:info@lifetek.com.vn">info@lifetek.com.vn</a>. Bên B có trách nhiệm trả lời tư vấn và khắc phục sự cố trong vòng 24h làm việc kể từ khi nhận được yêu cầu, nếu ngoài giờ làm việc của bên B mà bên A gặp sự cố, người sử dụng liên lạc theo số điện thoại nóng (04)3762.1194 hoặc (04)63287711 để được hỗ trợ.</li>\n</ul>\n\n<p><strong>ĐIỀU 5: THANH TOÁN</strong></p>\n\n<ul>\n <li><strong>Tổng giá trị hợp đồng</strong>: <strong>7,200,000 </strong><strong>VNĐ</strong> (<strong><em>Bảy triệu hai trăm ngàn đồng chẵn</em></strong>./.)</li>\n <li><strong>Hình thức và Thời hạn thanh toán : </strong></li>\n</ul>\n\n<ul>\n <li><em>Hình th</em><em>ức: </em></li>\n</ul>\n\n<ul>\n <li>Bên A sẽ thanh toán 100% giá trị hợp đồng bằng chuyển khoản cho bên B qua Ngân hàng hoặc tiền mặt.</li>\n <li>Đồng tiền tạm ứng và thanh toán là đồng VNĐ.</li>\n <li>Nếu có sự thay đổi về tài khoản thanh toán Bên B sẽ thông báo cho Bên A bằng văn bản.</li>\n</ul>\n\n<ul>\n <li><em>Thời hạn thanh toán:</em>\n\n <ul>\n  <li>Bên A sẽ thanh toán cho bên B 100%  giá trị hợp đồng với số tiền tương đương : <strong>7,200,000 VNĐ</strong> <strong><em>(Bảy triệu hai trăm ngàn đồng chẵn)</em></strong> ngay sau khi ký kết hợp đồng kinh tế;</li>\n  <li>Từ năm thứ hai trở đi, bên A có trách nhiệm thanh toán cho bên B 100%  phí dịch vụ sử dụng như sau:</li>\n </ul>\n </li>\n</ul>\n\n<table border="1" cellpadding="0" cellspacing="0">\n <tbody>\n  <tr>\n   <td xss=removed>\n   <ol>\n    <li> </li>\n   </ol>\n   </td>\n   <td xss=removed>\n   <p><strong>Dịch vụ</strong></p>\n   </td>\n   <td xss=removed>\n   <p><strong>Số tiền (vnđ)</strong></p>\n   </td>\n  </tr>\n  <tr>\n   <td xss=removed>\n   <ol>\n    <li> </li>\n   </ol>\n   </td>\n   <td xss=removed>\n   <ul>\n    <li> </li>\n   </ul>\n   </td>\n   <td xss=removed>\n   <ol>\n    <li> </li>\n   </ol>\n   </td>\n  </tr>\n  <tr>\n   <td colspan="2" xss=removed>\n   <p><strong>Tổng thanh toán từ năm thứ 2 trở đi</strong></p>\n   </td>\n   <td xss=removed>\n   <ol>\n    <li> </li>\n   </ol>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p xss=removed> </p>\n\n<p>Phí sử dụng được thanh toán trước 15 ngày của thời gian hết hạn.</p>\n\n<ul>\n <li>Trong trường hợp bên A thanh toán chậm cho bên B theo thời gian hợp đồng đã quy định thì bên A sẽ phải chịu lãi suất không kỳ hạn (tính theo lãi suất không kỳ hạn của ngân hàng Vietcombank) tại thời điểm của hợp đồng.</li>\n <li>Hình thức thanh toán bằng séc, tiền mặt hoặc chuyển khoản .</li>\n</ul>\n\n<p><strong>ĐIỀU 6:  QUYỀN VÀ TRÁCH NHIỆM BÊN A</strong></p>\n\n<ol>\n <li>Chịu trách nhiệm trước pháp luật về mục đích sử dụng và tính chính xác của các thông tin cung cấp, đảm bảo việc đăng ký, sử dụng dịch vụ đúng quy định hiện hành, không xâm phạm các quyền, lợi ích hợp pháp của các tổ chức, cá nhân khác.</li>\n <li>Chịu trách nhiệm về việc quản lý, duy trì quyền sử dụng tên miền và các dịch vụ phần mềm quản lý bán hàng trực tuyến 4Biz của mình và phải chịu trách nhiệm trong bất kỳ trường hợp vi phạm nào về sử dụng tên miền và các dịch vụ phần mềm quản lý bán hàng trực tuyến 4Biz của mình do quản lý lỏng lẻo gây ra.</li>\n <li>Chịu trách nhiệm quản lý và theo dõi thông tin về tình trạng hoạt động, thời hạn hiệu lực của tên miền và các dịch vụ phần mềm quản lý bán hàng trực tuyến 4Biz đã đăng  ký: Trong mọi trường hợp, tên miền  và các dịch vụ phần mềm quản lý bán hàng trực tuyến 4Biz không tiếp tục nộp phí duy trì khi đến hạn đều bị tự động tạm ngừng và thu hồi theo quy định. Thời gian nộp phí duy trì trước 10 đến 15 ngày kể từ ngày hết hạn.</li>\n <li>Cung cấp đầy đủ bản khai đăng ký tên miền Việt Nam theo quy định chậm nhất 15 ngày kể từ ngày đăng ký dịch vụ. Trong trường hợp chậm bổ sung, tên miền sẽ bị xóa mà không hoàn lại phí.</li>\n <li>Chấp nhận các Điều khoản thỏa thuận sử dụng dịch vụ  tại địa chỉ: <a href="http://www.lifetek.com.vn">http://www.lifetek.com.vn</a> và <a href="http://4Biz.vn">http://4Biz.vn</a> là một phần không thể tách rời hợp đồng này.</li>\n <li>Cung cấp thông tin và phối hợp với các cơ quan nhà nước có thẩm quyền để giải quyết, xử lý các vụ việc liên quan tới tên miền và các dịch vụ khác.</li>\n <li>Bên A chỉ chấp nhận ký biên bản bàn giao với bên B sau khi Điều 1 được Bên B thực hiện đầy đù.</li>\n <li>Phối hợp và cung cấp thông tin cần thiết liên quan đến nghiệp vụ cùng bên B trong quá trình bên B thực hiện triển khai, tìm hiểu và phân tích hệ thống</li>\n <li>Có trách nhiệm thanh toán phí tên miền và Hosting (như mục 1 và 2 điều 2 của Hợp đồng kinh tế ).</li>\n</ol>\n\n<p xss=removed> </p>\n\n<p><strong>ĐIỀU 7: QUYỀN VÀ TRÁCH NHIỆM BÊN B</strong></p>\n\n<ol>\n <li>Hoàn thành việc khởi tạo dịch vụ tên miền và dịch vụ phần mềm quản lý bán hàng phiên bản mặc định trong vòng ba (03) ngày làm việc kể từ khi nhận được đầy đủ thông tin và tiền thanh toán của bên A. Bên B chỉ cung cấp dịch vụ đăng ký tên miền trong phạm vi những tên miền chưa có chủ thể khác đăng ký trong thời gian hoàn thành việc đăng ký tên miền và dưới sự chấp thuận cấp phát của cơ quan quản lý tên miền.</li>\n <li>Bên B sẽ tiến hành nâng cấp phần mềm định kì nếu bên A có yêu cầu.Việc nâng cấp sẽ được trao đổi và bàn bạc giữa Bên A và Bên B. Nếu cần thiết sẽ lập thêm phụ lục hợp đồng kèm theo bản Hợp đồng chính này.</li>\n <li>Hướng dẫn cho bên A các kiến thức căn bản về chính sách quản lý và thông báo kịp thời cho bên A mỗi khi thay đổi về chính sách về quản lý tài nguyên Internet của Việt Nam.</li>\n <li>Cung cấp và đảm bảo các chuẩn kỹ thuật cần thiết để bên A thực hiện việc khai thác các dịch vụ liên quan.</li>\n <li>Cung cấp và chốt nghiệp vụ triển khai khi được sự thống nhất từ hai bên.</li>\n <li>Cung cấp cho bên A hoá đơn tài chính sau khi bên A thanh toán xong toàn bộ giá trị hơp đồng.</li>\n <li>Được quyền tạm ngưng các tài khoản dịch vụ truy cập tới LifeTek của Bên A hoặc xem xét chấm dứt hợp đồng của bên A trong trường hợp bên A không thực hiện đúng những điều khoản ràng buộc trong hợp đồng này.</li>\n</ol>\n\n<p>    </p>\n\n<p><strong>ĐIỀU 8: PHẠT DO VI PHẠM HỢP ĐỒNG</strong></p>\n\n<ol>\n <li>Nếu bên B tự ý hủy hợp đồng mà không được sự chấp thuận của bên A, thì bên B phải hoàn trả toàn bộ số tiền đã nhận.</li>\n <li>Nếu bên A tự ý hủy hợp đồng mà không được sự chấp thuận của bên B, thì bên A phải chịu mất toàn bộ số tiền đã thanh toán.</li>\n <li>Nếu các bên không thực hiện hoặc thực hiện không đầy đủ bất kỳ nghĩa vụ nào đưa ra trong hợp đồng này sẽ không bị coi là vi phạm thỏa thuận hoặc không phải chịu trách nhiệm nếu như sự việc đó phát sinh do bao gồm không giới hạn những nguyên nhân sau: thiên tai, các hành động hoặc cản trở của chính phủ hay bất kỳ quy định, luật lệ hoặc yêu cầu nào của cơ quan chức năng hay công chức, phòng ban, đại lý hoặc các công cụ của các cơ quan này, hỏa hoạn, bão lụt, động đất, tai nạn, hành động của kẻ địch, chiến tranh, nổi loạn, không kết nối được Internet, khởi nghĩa, xâm lược, đình công, hay đóng cửa của cả hai bên</li>\n <li>Nếu trong quá trình thực hiện hợp đồng, do điều kiện nào đó của một bên mà các điểm mốc thời gian có thể phải thay đổi thì bên đó phải có đề nghị chính thức bằng văn bản với bên kia, nếu nguyên nhân xảy ra khách quan thì 2 bên sẽ tích cực phối hợp giải quyết, trong trường hợp nguyên nhân phát sinh từ bên B và thời gian chậm là 2 tuần trở lên, bên B sẽ chịu mức phạt tối đa là 0,05% giá trị hợp đồng/ngày chậm. Nếu thời gian chậm tiến độ quá 1 tháng mà bên B không có văn bản xác nhận thì bên A có quyền đơn phương chấm dứt hợp đồng và bên B sẽ phải thanh toán lại cho bên A toàn bộ số tiền đã tạm ứng.</li>\n <li>Nếu nguyên nhân chậm tiến độ phát sinh từ bên A, thì bên A phải hoàn toàn chịu trách nhiệm về việc quá tiền độ, nếu bên A chậm tiến độ quá 1 tháng mà không có văn bản xác nhận cho bên B thì bên B có quyền đơn phương chấm dứt hợp đồng mà không cần báo trước và không thanh toán lại cho bên A bất cứ khoản chi phí tạm ứng nào trước đó.</li>\n</ol>\n\n<p><strong>ĐIỀU 9: PHƯƠNG THÚC NGHIỆM THU VÀ THANH LÝ</strong></p>\n\n<ol>\n <li>Phương thức nghiệm thu theo đúng lịch trình của kế hoạch triển khai đã thống nhất của 2 bên. Bên B đáp ứng đầy đủ nhu cầu của Bên A về việc thay đổi bổ sung các tính năng của chương trình ( các biên bản yêu cầu này phải có đầy đủ chữ kí của 2 bên.)</li>\n</ol>\n\n<p xss=removed>Bên B đã bàn giao đầy đủ hệ thống và hướng dẫn sử dụng một lần cho các thành viên tham gia vào hệ thống của Bên A (hỗ trợ khi chưa thực hiện được)</p>\n\n<ol>\n <li>Sau khi nghiệm thu, Bên B sẽ có thông báo bằng văn bản yêu cầu Bên A tiến hành thanh lý hợp đồng.</li>\n <li>Các biên bản: Nghiệm thu kỹ thuật, Thanh lý hợp đồng được lập thành 2 bản có giá trị pháp lý như nhau. Bên A giữ 01 bản, Bên B giữ 01 bản. Ngôn ngữ sử dụng trong các tài liệu nghiệm thu là Tiếng Việt</li>\n</ol>\n\n<p><strong>ĐIỀU 10: ĐIỀU KHOẢN CHUNG</strong></p>\n\n<ol>\n <li>Hợp đồng này có hiệu lực kể từ ngày ký và bên A đã thanh toán cho bên B theo Điều 2 của hợp đồng này.</li>\n <li>Bên B cam kết cung cấp dịch vụ trong tối thiểu 10 năm. Nếu bên B cung cấp dịch vụ với thời gian dưới 10 năm thì bên B cam kết phải trả lại bên A 50% khoản tiền hợp đồng mà bên A đã đóng.</li>\n</ol>\n\n<p xss=removed>Bên A cam kết sẽ phải sử dụng phần mềm ít nhất trong 3 năm liên tiếp, nếu không sẽ bị phạt 50% giá trị hợp đồng của 1 năm sử dụng tên miền và dịch vụ khác.</p>\n\n<ol>\n <li>Hết thời hạn duy trì tên miền và các dịch vụ phần mềm quản lý bán hàng trực tuyến 4Biz nêu tại Điều 1, hợp đồng này sẽ dừng nếu có văn bản ngừng hợp tác. Trường hợp tiếp tục gia hạn tên miền trong phụ lục hợp đồng duy trì tên miền và dịch vụ khác, bên A phải kí xác nhận vào phụ lục Hợp đồng duy trì tên miền, dịch vụ phần mềm quản lý bán hàng trực tuyến 4Biz và nộp đầy đủ các khoản phí mà Bên B quy định.</li>\n <li>Mọi tranh chấp phát sinh trong quá trình thực hiện sẽ được hai Bên thương lượng giải quyết trên tinh thần hợp tác, tôn trọng lẫn nhau. Trường hợp hai Bên không thống nhất giải quyết thì vụ việc sẽ được chuyển đến Tòa án có thẩm quyền để giải quyết, phán quyết của Tòa án là quyết định cuối cùng buộc các Bên phải chấp hành.</li>\n <li>Hai bên thống nhất nghiệp vụ theo nhu cầu thực tế của bên A, biên bản chốt nghiệp vụ là phụ lục được đính kèm không thể tách rời cùng với hợp đồng này.</li>\n <li>Hợp đồng này được lập thành 02 bản tiếng Việt, có giá trị pháp lý như nhau, mỗi bên giữ 01 bản để thực hiện.</li>\n</ol>\n\n<p><em>              Hà Nội, ngày      tháng 07   năm 2016</em></p>\n\n<table border="0" cellpadding="0" cellspacing="0">\n <tbody>\n  <tr>\n   <td xss=removed>\n   <p><strong>ĐẠI DIỆN BÊN A</strong></p>\n\n   <p> </p>\n   </td>\n   <td xss=removed>\n   <p><strong>ĐẠI DIỆN BÊN B</strong></p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p> </p>\n\n<p> </p>\n\n<p> </p>\n\n<p> </p>\n\n<p> </p>\n\n<p> </p>\n\n<p> </p>\n', 1),
(8, '!@#$%^&*()', '<p><strong>CỘNG HOÀ XÃ HỘI CHỦ NGHĨA VIỆT NAM</strong></p>\n\n<p>Độc lập - Tự do - Hạnh phúc</p>\n\n<p>-------------oOo-----------</p>\n\n<p> </p>\n\n<p><strong>HỢP ĐỒNG KINH TẾ</strong></p>\n\n<p><em>Số: ........../ 20…/ HĐKT</em></p>\n\n<p> </p>\n\n<p>   - Căn cứ Bộ luật Dân sự số 33/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào Luật Thương Mại số 36/2005/QH11 ngày 14/6/2005 của nước Cộng hòa xã hội chủ nghĩa Việt nam;</p>\n\n<p>- Căn cứ vào nhu cầu, khả năng của hai bên.</p>\n\n<p>Hôm nay, ngày …..  tháng ….năm 2015  Chúng tôi gồm:</p>\n\n<p><strong>Bên A:   </strong>{TEN_NCC}</p>\n\n<ul>\n <li>Địa chỉ                    :     {DIA_CHI_NCC}</li>\n <li>Điện thoại               :     {SDT_NCC}</li>\n <li>Fax                           :     …………………………………………………………………</li>\n <li>CMTND                  :   …………CA Thành phố ………….… cấp ngày…………..…..</li>\n</ul>\n\n<p><strong>Bên B:   Công ty TNHH Công Nghệ Tự Động Hóa Minh Anh.</strong></p>\n\n<ul>\n <li>Địa chỉ                    :    Số 23 ngõ 389/4 Hoàng Quốc Việt – Quận Cầu Giấy -  Hà Nội.</li>\n <li>Điện thoại               :     +84 4–378 5885.</li>\n <li>Fax                           :     +84 4–378 5885.</li>\n <li>Mã số thuế                 :     0101130774.</li>\n <li>Đại diện bởi           :     Ông  <strong>Nguyễn Xuân Giang</strong></li>\n <li>Chức vụ                  :     Phó Giám đốc</li>\n <li>Tài khoản số          :     10820962715015</li>\n <li>Tại Ngân hàng        :     Ngân hàng TMCP Kỹ Thương – CN Hoàn Kiếm – Hà Nội</li>\n</ul>\n\n<p> </p>\n\n<p>Tại Trụ sở bên A, hai bên thỏa thuận ký kết hợp đồng kinh tế này với các điều khoản sau:</p>\n\n<p><strong><em>Điều 1:</em></strong><strong><em> Nội dung công việc</em></strong></p>\n\n<p>1.1. Bên B nhận cung cấp bằng nhập khẩu cho bên A  …… ( ….. ) thang máy tải khách (mã hiệu ………..), tải trọng …..kg (….. người ), tốc độ …… m/phút, ….. điểm dừng , xuất xứ ………, mới 100%, sản xuất năm ……. trở về sau.</p>\n\n<p><em>(Theo Bản Phụ lục Hợp đồng 1)</em></p>\n\n<p>1.2. Cung cấp vật tư lắp đặt và lắp đặt hoàn chỉnh thang máy trên tại công trình :</p>\n\n<p>“……………………………………………………………………………………………………………………………………………..……………”</p>\n\n<p><strong><em>Điều 2:</em></strong><strong><em> Trách nhiệm của bên A</em></strong></p>\n\n<ul>\n <li>Xây dựng, hiệu chỉnh hố thang đảm bảo các thông số kỹ thuật cho việc lắp đặt thang máy theo bản vẽ kỹ thuật hố thang do bên B cung cấp.</li>\n <li>Chậm nhất là trong vòng 5 ngày kể từ ngày bên B chuyển bản vẽ kỹ thuật, bên A phải ký xác nhận vào bản vẽ kỹ thuật sau khi đã thống nhất để Bên B đặt hàng với Hãng sản xuất. Quá thời hạn trên coi như bên A đã đồng ý với bản vẽ kỹ thuật mà bên B đã chuyển để hai bên thực hiện công việc.</li>\n <li>Bên A giao đầy đủ hồ sơ thiết kế liên quan đến hố thang máy cho Bên B.</li>\n <li>Cử cán bộ có trách nhiệm phối hợp cùng bên B tham gia kiểm tra và ký xác nhận thiết bị thang máy khi lô thiết bị được chuyển về chân công trình. Nếu tại thời điểm hàng về chân công trình, bên A không bố trí được người kiểm tra, bên B vẫn vận chuyển lô thiết bị trên vào kho và lô thiết bị trên coi như đã được kiểm tra đầy đủ, đúng theo danh mục hồ sơ thang máy kèm theo.</li>\n <li>Bố trí kho chứa thiết bị an toàn tại tầng một khi bên B vận chuyển thiết bị đến công trình và đảm bảo an ninh cho kho chứa thiết bị thang máy tại công trình.</li>\n <li>Bàn giao mặt bằng đủ điều kiện để thi công lắp đặt cho bên B đúng tiến độ.</li>\n <li>Cung cấp điểm đấu nối nguồn điện để thi công, lắp đặt thang máy trong khu vực thi công.</li>\n <li>Cung cấp nguồn điện 3 phase 380V/220V và 01 Aptomat 3 phase /1 thang và điểm đấu nối dây tiếp địa tại phòng đặt máy để bên B hiệu chỉnh thang máy .</li>\n <li>Bên A cử cán bộ kỹ thuật thường xuyên phối hợp cùng bên B trong suốt quá trình thi công lắp đặt để giải quyết kịp thời các công việc trong quá trình thực hiện hợp đồng.</li>\n <li> Tổ chức nghiệm thu, ký biên bản nghiệm thu giai đoạn (nếu có) và nghiệm thu bàn giao kịp thời khi bên B hoàn tất công việc.</li>\n <li>Thực hiện phần việc xây dựng hoàn thiện sau khi bên B hoàn tất lắp đặt thiết bị thang máy.</li>\n <li>Tạm ứng và thanh toán kịp thời cho Bên B theo điều 6 của Hợp đồng.</li>\n</ul>\n\n<p><strong><em>Điều 3:</em></strong><strong><em> Trách nhiệm của bên B</em></strong></p>\n\n<ul>\n <li>Khảo sát và thiết kế bản vẽ hố thang theo tiêu chuẩn và chuyển cho bên A ký xác nhận làm cơ sở đặt hàng với Hãng sản xuất và thực hiện các công việc liên quan.</li>\n <li>Nhập khẩu thiết bị thang máy theo các thông số kỹ thuật của Phụ lục số 01 về đặc tính kỹ thuật thang máy.</li>\n <li>Trước khi vận chuyển thiết bị về công trình, bên B có trách nhiệm thông báo cho bên A ngày thiết bị về đến công trình để bên A bố trí kho chứa thiết bị tại công trình.</li>\n <li>Vận chuyển thiết bị đến công trình,  phối hợp cùng với đại diện của bên A kiểm tra và ký xác nhận vào các biên bản.</li>\n <li>Cung cấp vật tư  lắp đặt và lắp đặt, hiệu chỉnh, đưa thang máy vào sử dụng.</li>\n <li>Có trách nhiệm mời cơ quan có chức năng, tổ chức kiểm định - cung cấp Biên bản kiểm định kỹ thuật an toàn thang máy của cơ quan Nhà nước có thẩm quyền đủ điều kiện an toàn sử dụng bàn giao cho bên A.</li>\n <li>Có trách nhiệm quản lý, đảm bảo an ninh, an toàn trong quá trình thi công trên công trình và giữ gìn vệ sinh môi trường trong suốt thời gian thi công.</li>\n <li>Đảm bảo và chịu trách nhiệm về các điều kiện an toàn cho con người, an ninh trong khu vực thi công theo quy định chung.</li>\n <li>Hướng dẫn cách sử dụng vận hành thang máy cho bên A.</li>\n <li>Bên B có trách nhiệm bảo hành công trình theo quy định tại điều 7 của Hợp đồng kinh tế.</li>\n</ul>\n\n<p><strong><em>Điều 4:</em></strong><strong><em> Tiến độ thực hiện được bên B thực hiện như sau:  </em></strong></p>\n\n<table border="0" cellpadding="0" cellspacing="0">\n <tbody>\n  <tr>\n   <td>\n   <p>4.1 Thời gian thiết bị thang máy đ­ược nhập khẩu và vận chuyển đến công trình kể từ ngày bên B nhận được kinh phí tạm ứng kỳ 1 và bên A xác nhận vào bản vẽ kỹ thuật hố thang là: …. tháng</p>\n   </td>\n  </tr>\n  <tr>\n   <td>\n   <p>4.2 Thời gian lắp đặt, hiệu chỉnh được thực hiện khi bên B nhận được kinh phí thanh toán kỳ 2, bên A bàn giao mặt bằng đầy đủ điều kiện thi công và ký biên bản nghiệm thu thiết bị trước khi lắp đặt là: ….. ngày</p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n<p>-   Tiến độ trên chỉ được thực hiện với các điều kiện sau:</p>\n\n<ul>\n <li>Bên A thanh toán đúng thời hạn và giá trị đã ghi ở điều 5 và điều 6 hợp đồng này.</li>\n <li>Các chi tiết kỹ thuật của thang máy phải được bên A thống nhất trước khi ký kết hợp đồng kinh tế. Trong trường hợp có những thay đổi về chi tiết kỹ thuật của thang máy từ phía bên A như bổ sung, bỏ bớt hoặc điều chỉnh thì hai bên thống thất bằng một văn bản hoặc phụ lục hợp đồng bổ sung để hiệu chỉnh giá trị hợp đồng và tiến độ thực hiện nhưng thời gian cho việc thay đổi trong vòng 30 ngày kể từ ngày hợp đồng có hiệu lực.</li>\n <li>Việc lắp đặt thang máy chỉ được tiến hành sau khi điều 4.2 đã được thực hiện .</li>\n</ul>\n\n<p><strong><em>Điều 5:</em></strong><strong><em>  Giá trị của hợp đồng kinh tế </em></strong></p>\n\n<ul>\n <li>Giá trị hợp đồng kinh tế cung cấp lắp đặt thang máy là: khoản tiền VNĐ có giá trị bảo đảm tương đương: <strong>………….. VND <em>(…………………….. VND</em></strong>) <strong>.</strong>             </li>\n</ul>\n\n<p><strong><em>               ( Bằng chữ: …………………………………………………………………. )</em></strong></p>\n\n<ul>\n <li><em>Giá trị hợp đồng trên đã bao gồm: giá thiết bị thang máy nhập khẩu về tới chân công trình, vật tư lắp đặt, chi phí lắp đặt, hiệu chỉnh, tổ chức kiểm định thang máy cấp giấy chứng nhận thang máy đủ điểu kiện an toàn sử dụng, chi phí bảo hành  và thuế GTGT.</em></li>\n</ul>\n\n<p><strong><em>Điều 6:</em></strong><strong><em> Ph­ương thức thanh toán </em></strong></p>\n\n<ul>\n <li>Bên A tạm ứng, thanh toán cho bên B theo các kỳ nh­ư sau:</li>\n</ul>\n\n<ul>\n <li>Kỳ 1: Tạm ứng <strong>40</strong>% tổng giá trị hợp đồng kinh tế ngay sau khi Hợp đồng kinh tế được ký kết.</li>\n</ul>\n\n<ul>\n <li>Kỳ 2: Thanh toán 5<strong>0%</strong> tổng giá trị hợp đồng kinh tế - không bao gồm giá trị đã tạm ứng kỳ 1 - trong vòng 7 ngày sau khi thiết bị thang máy đ­ược chuyển đến chân công trình.</li>\n <li>Kỳ 3: Thanh toán phần còn lại của tổng giá trị hợp đồng trong vòng 10 ngày kể từ ngày bên B hoàn tất việc lắp đặt và thang máy được kiểm định an toàn.</li>\n</ul>\n\n<ul>\n <li>Tr­ường hợp bên A không thực hiện đầy đủ nghĩa vụ thanh toán như­ đã thống nhất ở trên, bên B có quyền ngừng thực hiện các công việc liên quan đến thang máy cho đến khi bên A hoàn thành nghĩa vụ thanh toán của mình và đền bù những thiệt hại cho bên B theo lãi suất quá hạn cho vay của Ngân hàng bên B mở tài khoản.</li>\n <li>Trong trường hợp bên B đã hoàn thành toàn bộ công việc theo như hợp đồng kinh tế đã ký kết mà bên A chưa có nguồn điện chính thức để sử dụng thang máy, hoặc chưa có nhu cầu sử dụng thì trách nhiệm của bên A là phải hoàn thành nghĩa vụ thanh toán toàn bộ giá trị hợp đồng cho bên B để bên B quyết toán hợp đồng và thực hiện nghĩa vụ nộp thuế theo quy định của Nhà nước.</li>\n</ul>\n\n<p><strong><em>Điều 7 :</em></strong><strong><em> Bảo hành và Bảo trì</em></strong></p>\n\n<ul>\n <li>Bên B có trách nhiệm bảo hành thiết bị trong thời hạn 12 tháng kể từ ngày thang máy được kiểm định an toàn. Nếu trong thời gian bảo hành mà thang máy bị hư hỏng, nhận được thông báo của bên A trong thời gian sớm nhất bên B phải cử người đến xử lý và chịu mọi phí tổn sửa chữa nếu xảy ra sự cố kỹ thuật do lỗi của nhà sản xuất hoặc do lỗi khác của bên B.</li>\n <li>Bên B có trách nhiệm lập quy trình bảo trì cho công trình khi hết thời hạn bảo hành và hai bên sẽ thương thảo, ký kết hợp đồng bảo trì cho công trình.</li>\n</ul>\n\n<p><strong><em>Điều 8:</em></strong><strong><em>  Hiệu lực hợp đồng </em></strong></p>\n\n<ul>\n <li>Hợp đồng kinh tế này có hiệu lực kể từ ngày ký và không đư­ợc hủy ngang, nếu bên nào vi phạm thì sẽ đền bù cho bên còn lại 20% giá trị Hợp đồng kinh tế.</li>\n <li>Hai bên cam kết thực hiện đúng các điều khoản ghi trong hợp đồng kinh tế. Khi có  vướng mắc hai bên cùng trao đổi để khắc phục. Nếu không giải quyết được bằng thương lượng thì một trong hai bên sẽ đưa ra Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội để giải quyết. Phán quyết của Toà án Nhân dân có thẩm quyền thuộc thành phố Hà Nội là phán quyết cuối cùng để hai bên thực hiện, mọi chi phí phát sinh và án phí do bên có lỗi chịu trách nhiệm thanh toán.</li>\n <li>Hợp đồng này đ­ược lập thành ….. bản, mỗi bên giữ …. bản và có giá trị pháp lý nh­ư nhau.</li>\n</ul>\n\n<p><strong>                  ĐẠI DIỆN BÊN A                                              ĐẠI DIỆN BÊN B</strong></p>\n', 2),
(10, '11111', '<p>Hợp đồng vay vốn</p>\n', 1),
